INSERT INTO `block_translations` (`id`, `block_id`, `locale`, `title`, `summary`, `content`) VALUES
(1, 1, 'en', 'About us', 'About us content', '<p>We are the Real Estate Agency that takes the time to get to know its clients and understand their needs. We follow up and we get the job done.</p>\r\n<p>With over 20 years of client-focussed and results-driven commitment to service and expertise, HSM Property will help you fulfill all your Real Estate needs and goals. Whether you speak English, French, German or Italian, we’re ready to work with you today.</p>\r\n<p>Conveniently situated in the heart of the European District, just off Rond Point Schuman, our office is idealy located for local and international clients, EU officials, their business partners looking to buy, sell, or rent their home, their investment property and their commercial space.</p>\r\n<p>HSM real estate agents are licensed under the IPI (Institue Professional des Agents Immobilers). We have in-depth and up-to-date knowledge of the local market and regulations.</p>\r\n<p>Isn’t it about time you got the personalized and responsive service you deserve? Come by our office, call or email us so that HSM Property can help you meet your real estate goals.</p>\r\n<p>You can contact us during the week, the evenings and weekends as well.</p>\r\n'),
(2, 1, 'fr', 'About us', 'About us content', '<p>On parle du temps...... une agence qui prend le temps de conna&icirc;tre ses clients et de comprendre leurs besoins - et - fait le suivi!</p>\n<p>Avec une exp&eacute;rience &eacute;prouv&eacute;e en mati&egrave;re de service et d\'expertise depuis plus de 20 ans, HSM (Hickl-Szabo - Meschi) vous aidera &agrave; r&eacute;pondre &agrave; tous vos besoins et objectifs immobiliers. Que vous parliez anglais, fran&ccedil;ais, allemand ou italien, nous sommes pr&ecirc;ts &agrave; travailler avec vous aujourd\'hui. Et, nous travaillons sur notre n&eacute;erlandais!</p>\n<p>Id&eacute;alement situ&eacute; au c&oelig;ur du quartier europ&eacute;en, juste &agrave; c&ocirc;t&eacute; du Rond point Schuman, notre bureau est id&eacute;al pour les fonctionnaires de l\'UE, leurs partenaires commerciaux et toute personne d&eacute;sireuse d\'acheter, vendre ou louer leur maison, leur immeuble d\'investissement ou leur espace commercial. ...</p>\n<p>Tous les agents immobiliers HSM sont agr&eacute;&eacute;s par l\'IPI (Institut Professionnel des Agents Immobiliers). Nous avons une connaissance approfondie et &agrave; jour du march&eacute; local et des r&eacute;glementations.</p>\n<p>N\'est-il pas temps que vous obteniez le service personnalis&eacute; et r&eacute;actif que vous m&eacute;ritez? Venez &agrave; notre bureau, appelez ou envoyez-nous un courriel afin que HSM puisse vous aider &agrave; atteindre vos objectifs immobiliers.</p>'),
(3, 2, 'en', 'Contact', 'contact', '<p>contact&nbsp;&nbsp;&nbsp;</p>'),
(4, 2, 'fr', 'Contact', 'contact', '<p>contact</p>'),
(5, 3, 'en', 'Our Services', 'Our Services', '<p><u>Our Services</u></p>'),
(6, 3, 'fr', 'Our Services', 'Our Services', '<p><u>Our Services</u></p>'),
(7, 4, 'en', 'Sale', 'Sale', 'We will sell your property as efficiently and effectively as possible while ensuring that you get the best\nmarket value'),
(8, 4, 'fr', 'Sale', 'Sale', 'Fr We will sell your property as efficiently and effectively as possible while ensuring that you get the best\nmarket value'),
(9, 5, 'en', 'Commercial', 'Commercial', 'Whether your property is an office or HORECA or any other commercial space we can help you\nto sell it or rent it as is best for you'),
(10, 5, 'fr', 'Commercial', 'Commercial', 'Whether your property is an office or HORECA or any other commercial space we can help you\nto sell it or rent it as is best for you'),
(11, 6, 'en', 'Investment', 'Investment', 'Are looking at real estate as a way to invest and or diversify your savings? We can help you'),
(12, 6, 'fr', 'Investment', 'Investment', 'Are looking at real estate as a way to invest and or diversify your savings? We can help you'),
(13, 7, 'en', 'Evaluations', 'Evaluations', 'You are looking to sell or rent your house or you’re simply curious to know what your property is\nworth? We can help you to accurately evaluate the true value of your property.'),
(14, 7, 'fr', 'Evaluations', 'Evaluations', 'You are looking to sell or rent your house or you’re simply curious to know what your property is\nworth? We can help you to accurately evaluate the true value of your property.'),
(15, 8, 'en', 'Property Hunting', 'Property Hunting', 'Whether you live abroad or right here in Brussels you may not have the time or the\nexpertise to find the right property for rent or for sale – hire us to do the property hunting for you.'),
(16, 8, 'fr', 'Property Hunting', 'Property Hunting', 'Whether you live abroad or right here in Brussels you may not have the time or the\nexpertise to find the right property for rent or for sale – hire us to do the property hunting for you.'),
(17, 9, 'en', 'Home staging', 'Home staging', 'We will tell you what you need to do to ensure that your property presents itself in the best\npossible way to ensure a quick and fruitful rental or sale. Quick easy professional tips are sometimes all you need\nto make your property that much more attractive…'),
(18, 9, 'fr', 'Home staging', 'Home staging', 'We will tell you what you need to do to ensure that your property presents itself in the best\npossible way to ensure a quick and fruitful rental or sale. Quick easy professional tips are sometimes all you need\nto make your property that much more attractive…'),
(19, 10, 'en', 'Consulting and Advice', 'Consulting and Advice', '<p>With over 40 years of experience and expertise between us we know how the real estate market works and can provide you the advice and answers you need.1</p>'),
(20, 10, 'fr', 'Consulting and Advice', 'Consulting and Advice', '<p>With over 40 years of experience and expertise between us we know how the real estate market works and can provide you the advice and answers you need.1</p>'),
(21, 11, 'en', 'International Properties', 'International Properties', 'Are you looking to invest in Italy, Greece, Canada, the USA? We have contacts in\ndifferent markets and can help you.'),
(22, 11, 'fr', 'International Properties', 'International Properties', 'Are you looking to invest in Italy, Greece, Canada, the USA? We have contacts in\ndifferent markets and can help you.'),
(23, 12, 'en', 'Crowd Funding', 'Crowd Funding', 'It is an opportunity for individuals and companies to directly support a business project.\nHolders make what is called: “a public offering” in the form of a loan. In exchange for this loan, you receive a\nreturn in the form of variable interest depending on the borrower&#39;s project, his profile and the duration of the loan.'),
(24, 12, 'fr', 'Crowd Funding', 'Crowd Funding', 'It is an opportunity for individuals and companies to directly support a business project.\nHolders make what is called: “a public offering” in the form of a loan. In exchange for this loan, you receive a\nreturn in the form of variable interest depending on the borrower&#39;s project, his profile and the duration of the loan.'),
(25, 13, 'en', 'Rent', 'Rent', 'We aim to find the best possible tenant for your property, one that is solvent and will care for your\nproperty as though it is their own'),
(26, 13, 'fr', 'Rent', 'Rent', 'We aim to find the best possible tenant for your property, one that is solvent and will care for your\nproperty as though it is their own'),
(27, 14, 'en', 'Residential', 'Residential', 'We have years of experience with residential properties of all sizes, all over Belgium and\ninternationally. Whether this is your first home or an additional investment property we can help you to sell it, or\nrent it as suits your needs'),
(28, 14, 'fr', 'Residential', 'Residential', 'We have years of experience with residential properties of all sizes, all over Belgium and\ninternationally. Whether this is your first home or an additional investment property we can help you to sell it, or\nrent it as suits your needs'),
