(39, 26, 'en', 'How It Works', NULL, NULL),
(40, 26, 'fr', 'Comment ça fonctionne', NULL, NULL),
(41, 27, 'en', 'Tour.', 'The hard-working helper that <br/> saves you time.', 'Hum spends the day finding people & content for <br/> you in the background based on some settings <br/> like brands you aspire to be like.You\'ll recieve a <br/> direct message every day full of valuable <br/> information collected just for your account.'),
(42, 27, 'fr', 'Lassistant travailleur qui vous fait gagner du temps.', 'Lassistant travailleur qui vous fait gagner du temps', 'Hum passe la journée à rechercher des personnes et du contenu pour vous en arrière-plan en fonction de certains paramètres tels que les marques auxquelles vous aspirez. Vous recevrez chaque jour un message direct contenant des informations précieuses collectées uniquement pour votre compte.'),
(44, 28, 'fr', 'Configurez votre compte.', 'Configurez votre compte.', 'Dites-nous vos centres d\'intérêt personnels et professionnels et plus encore.Nous utilisons ces informations pour trouver vos cercles spécifiques de  personnes sur Twitter.'),
(43, 28, 'en', 'Set up your account.', 'Set up your account.', 'Tell us your personal & professional interests and more.<br/>We use these insights to find your specific circles of <br/> people on Twitter.'),
(45, 29, 'en', 'Personalized daily DM', 'Personalized daily DM', 'Every day we send you a personalized direct message <br/> that includes a people worth following and popular <br/> tweets in your niche.'),
(46, 29, 'fr', 'DM quotidien personnalisé', 'DM quotidien personnalisé', 'Chaque jour, nous vous envoyons un message direct personnalisé qui inclut une personne à suivre et des tweets populaires dans votre créneau.'),
(48, 30, 'en', 'Meet new people.', 'Meet new people.', 'We\'ll find people into the same things as you with <br/> around the same number of followers as you.Continue <br/> posting content and being helpful.'),
(49, 30, 'fr', 'Rencontrer de nouvelles personnes.', 'Rencontrer de nouvelles personnes.', 'Nous trouverons des personnes dans les mêmes domaines que vous avec à peu près le même nombre d\'abonnés que vous. Continuez à publier du contenu et à être utile.'),
(50, 31, 'en', 'Find interesting content.', 'Find interesting content.', 'As you interact with other people\'s content <br/> meaningfully,your personal brand,network,and pool of <br/> opportunities will grow.'),
(51, 31, 'fr', 'Trouvez du contenu intéressant.', 'Trouvez du contenu intéressant.', 'Au fur et à mesure que vous interagissez avec le contenu d\'autres personnes de manière significative, votre marque personnelle, votre réseau et votre pool d\'opportunités se développeront.'),
(52, 32, 'en', 'Its free to sign up', 'Start your 30-day free trial, then only $35/month.<br/>Cancel anytime.', '<p>Adding a credit card now helps us prevent spammers <br/> from signing up, which means better deliverability for <br/>everyone, including you. Your card won\'t be charged <br/> during your 30-day trial unless you send more than <br/> 5,000 messages. After your trial, you will be moved to <br/> the Foundation 50k, but you can always select pay-<br/> as-you-go or a different plan of your choice.</p>\r\n<p>This is a secure 256-bit TLS encrypted form - your <br/> data is safe with us.</p>'),
(53, 33, 'en', NULL, NULL, '<p>Lorem ipsum dolor sit amet. Ut quas molestiae sed maxime mollitia et omnis ratione quo nihil blanditiis ut ipsam maxime et incidunt soluta. Hic minima sint et doloremque maxime aut quasi tempora non itaque omnis.</p>\r\n\r\n<p>Est odit sint est iste sapiente eos dolor nihil. Ut ratione ratione qui fugit fuga 33 dolores voluptatum sed velit esse ex natus expedita quo esse enim. Qui ipsa amet eos animi commodi qui veritatis dolorem qui consequatur cupiditate eum unde dolor ea obcaecati voluptatem et tempore quos. Id labore rerum hic iure labore qui quidem voluptatem ut sequi dignissimos et natus suscipit ea enim facere et rerum quas.</p>\r\n\r\n<p>At dolores saepe non voluptas aliquid eos alias delectus ab culpa consequuntur ut dolorem culpa. Cum earum quibusdam sit sapiente odit cum nihil vero! Et ullam dolorum qui cumque molestiae sed laboriosam maiores et commodi dignissimos. Ut sapiente quibusdam eum fuga libero ab nemo aperiam.</p>');
