(1804, 'fra', 'Property', 112, 'desc', 'Excellent condition, spacious and comfortable villa of +/- 300m² surrounded by a fantastic +/- 3000m .garden. It consists of entrance hall with cloakroom, large fitted kitchen with breakfast area, double living room with fireplace, dining room , shower room with WC, 2 bedrooms/offices. On 1st floor : hall , 2 bedrooms , bathroom , master suite with dressing room and bathroom . Attic with potential to convert to more living space. Two-car garage with automatic door to cellar, game room with fireplace, shower room with toilet and laundry . Second seperate 2 car garage. Gas boiler , double glazed windows and high quality finishings. PEB 228kWh/m². For info and visits Sonja: 0485 27 10 82 or Alessandro : 0496 20 22 63'),
(1805, 'eng', 'Property', 112, 'desc', 'EVERBERG-KORTENBERG superbe villa de +/- 300m² avec terrain de +/- 3000m². Elle se compose: hall d\'entrée avec vestiaire, grande cuisine super équipée avec coin à déjeuner, double salon avec feu ouvert, salle a manger, sdd avec WC, 2 chambres (possibilité profession libérale) et plusieurs accès au jardin. Au1er étage: hall de nuit, 2 chambres, salle de bains, master bedroom (suite) avec avec dressing, salle de bains. Grenier aménageable. Garage pour deux voitures avec porte automatique au ssol plus cave, salle de jeux avec feu ouvert, salle de douche avec WC et buanderie. Deuxième garage 2 voitures à l’extérieur. Chaudière au gaz, double vitrage pare-balles et finitions de haute qualité.PEB 228kWh/m². Info et visite Alessandro Meschi 0496 20 22 63'),
