(1843, 'fra', 'Property', 116, 'desc', 'Quartier Européenne – Très jolie appartement de 60 m² entièrement rénové et meublé et équipée, situé au 2eme  étage dans une petite maison. Living avec cuisine super  équipé, grande chambre double lit avec armoire, salle de bain avec baignoire et machine a laver, mezzanine spacieux avec canapé lit pour les invites ou à utiliser comme 2eme chambre, abonnement   internet et TV compris.'),
(1844, 'eng', 'Property', 116, 'desc', 'European district - Very nice and renovated furnished apartment of 60m² on the 2nd floor in a small house. Living room with equipped kitchen, large bedroom with wardrobe, bathroom with tub and washing machine, spacious attic with sofa-bed for guests or to use as a 2nd room, internet and TV included. Info and visits Alessandro Meschi 0496 20 22 63'),
