(1968, 'eng', 'Block', 2, 'content', '<img src=\"/img/son-ale-photo.jpg\" alt=\"Sonja y Ale\" style=\"float:right; width:35% ; margin-left:5%\">\nIt’s about time: an agency that takes the time to get to know its clients and understand their needs - and - actually follows up!\n\nWith a proven track record of unparalleled client-focussed and results-driven commitment to service and expertise dating back over 20 years, HSM (Hickl-Szabo Meschi) will help you fulfill all your real estate needs and goals. Whether you speak English, French, German or Italian, we’re ready to work with you today. And, we’re working on our Dutch!\n\nConveniently situated in the heart of the European District, just off Rond point Schuman, our office is ideal for EU officials, their business partners and anyone else looking to buy, sell, or rent their home, their investment property, or their commercial space....\n\nAll HSM real estate agents are licensed under the IPI (Institue Professional des Agents Immobilers). We have in-depth and up-to-date knowledge of the local market and regulations.\n\nIsn’t it about time you got the personalized and responsive service you deserve? Come by our office, call or email us so that HSM can start helping you meet your real estate goals.'),
(1969, 'fra', 'Block', 2, 'content', '<img src=\"/img/son-ale-photo.jpg\" alt=\"Sonja y Ale\" style=\"float:right; width:35% ; margin-left:5%\">\nOn parle du temps...... une agence qui prend le temps de connaître ses clients et de comprendre leurs besoins - et - fait le suivi!\n\nAvec une expérience éprouvée en matière de service et d\'expertise depuis plus de 20 ans, HSM (Hickl-Szabo - Meschi) vous aidera à répondre à tous vos besoins et objectifs immobiliers. Que vous parliez anglais, français, allemand ou italien, nous sommes prêts à travailler avec vous aujourd\'hui. Et, nous travaillons sur notre néerlandais!\n\nIdéalement situé au cœur du quartier européen, juste à côté du Rond point Schuman, notre bureau est idéal pour les fonctionnaires de l\'UE, leurs partenaires commerciaux et toute personne désireuse d\'acheter, vendre ou louer leur maison, leur immeuble d\'investissement ou leur espace commercial. ...\n\nTous les agents immobiliers HSM sont agréés par l\'IPI (Institut Professionnel des Agents Immobiliers). Nous avons une connaissance approfondie et à jour du marché local et des réglementations.\n\nN\'est-il pas temps que vous obteniez le service personnalisé et réactif que vous méritez? Venez à notre bureau, appelez ou envoyez-nous un courriel afin que HSM puisse vous aider à atteindre vos objectifs immobiliers.'),
(1970, 'eng', 'Block', 2, 'title', 'About us'),
