(2004, 'fra', 'Property', 131, 'desc', 'Appartement élégant sur une des plus belles avenues de Schaerbeek. 1er étage d\'une belle maison bruxelloise, parfaitement restauré, grand et lumineux appartement une chambre avec un bureau, cuisine moderne équipée, salon et salle à manger, et mezzanine pour 2ème lit. Hauts plafonds, moulures, parquet, double vitrage, balcon à l\'avant et la possibilité de créer une magnifique terrasse à l\'arrière. Electricité conforme, volets à l\'arrière, compteurs individuels, chaudière au gaz. Très bien situé à proximité des transports en commun, des parcs, des restaurants et des magasins ainsi que l\'EEB4 et l\'OTAN. \'PEB D\'. Pour informations et visites tel Sonja +32 (0) 485 271 082'),
