(2151, 'eng', 'Property', 143, 'desc', 'This superb 260m² duplex is on the 1st and 2nd floor of a wonderful \"maison de maitre\" in upper  Schaerbeek, near Wolumé. Large entrance hall, beautiful living room, dining room, study,  fireplace, modern fitted kitchen with breakfast area which opens onto a large terrace and private flower garden. Upstairs; 3 large bright bedrooms, 2 bathrooms and a dressing room. In the basement; 2 large cellars. Possible to sublet private parking for 120 € / month. Close to public transport, shops, restaurants, parks and the EU institutions. PEB is under way. Info/visits Sonja 0485271082'),
(2152, 'fra', 'Property', 143, 'desc', 'Ce superbe duplex de 260 m² est au 1er et 2ème étage d\'une merveilleuse maison de maître dans le haut de Schaerbeek, limite Woluwé. Grand hall d\'entrée, belle salle de séjour, salle à manger, bureau avec feu ouvert, cuisine moderne équipée avec coin repas qui ouvre sur une grande terrasse et jardin fleuri privé. À l\'étage; 3 grandes chambres lumineuses, 2 salles de bains et un dressing. Au sous sol; 2 grand caves. Possible de sous-louer un parking privé pour 120€/mois. A proximité de transports en publiques, magasins, restaurants, le prestigieux Institut de la Vierge Fidèle, le parc du 50aire et les institutions EU. PEB est en cours.Info/visites Sonja 0485271082'),
