(2759, 'eng', 'Property', 201, 'desc', 'Perfectly furnished 2 bedroom flat. Very comfortable and newly renovated. Entrance hall, bright living-dining room, balcony, Large bedroom with en-suite bathroom, 2nd smaller bedroom and 2nd bathroom, Fully fitted eat-in kitchen with 2nd balcony. Laundry room. Parking garage included. Excellent location, calm and charming neighbourhood, walking distance to ULB, public transport, shops, restos and parcs. Charges of 200€. PEB E-. For info and visits call +32485271082'),
