(2773, 'eng', 'Property', 203, 'desc', 'In this lovely Art DECO building, on the 4th floor, is a stunningly beautiful, appartment, fully furnished with top of the line, designer furniture and fittings. A security door opens into a bright, elegant hallway. There is a large, eat-in kitchen, with everything you need. There is a dining room with a decorative fire place and a marble dining table, a living room with flat screen TV, a den or study or library with built-in book shelves leads out to a charming balcony with a great view of the EU area. There are 2 bathrooms, one with a shower and the other with a bath tub, both are impeccable, modern and very clean. 2 spacious bedrooms, one with it\'s own en-suite bathroom both with built-in closets. The flat also has a seperate room (15m²) that was originally the servants quarters, this is the storrage space and laundry room equipped with washer and dryer. There is also a basement area ideal for wine! Optional parking garage is also available for 150eurs/month. PEB to follow. For info and visits call +32 458 271 082'),
(2774, 'fra', 'Property', 203, 'desc', 'Dans ce bel immeuble Art Deco, au 4ème étage, se trouve un appartement d\'une beauté incroyable, entièrement meublé avec des meubles et finitions haut de gamme. Une porte de sécurité s\'ouvre sur un couloir lumineux et élégant. Il y a une grande cuisine, avec tout ce dont vous avez besoin. Il y a une salle à manger avec une cheminée décorative et une table à manger en marbre, un salon avec télévision à écran plat, un bureau ou une bibliothèque avec étagères intégrées qui mène à un charmant balcon avec une vue magnifique sur la zone de l\'UE. Il y a 2 salles de bains, une avec une douche et l\'autre avec une baignoire, les deux sont impeccables, modernes et très propres. 2 chambres à coucher spacieuses, une avec sa propre salle de bains et les deux avec des placards intégrés et dressing. \nL\'appartement dispose également d\'une séparée (15m²) qui était à l\'origine le chambre de bonne c\'est l\'espace de rangement et la buanderie équipée d\'une laveuse et sécheuse. Il y a aussi une cave idéal pour le vin! Un parking en option est également disponible pour 150eurs / mois. PEB à suivre. Pour info et visites appelez le +32 458 271 082'),
