(2780, 'eng', 'Property', 204, 'desc', 'Officially in Schaerbeek but only a stones throw from WSP - This loft is a treasure! The Interior was designed by an architect and every detail is perfect! Enter into a huge living dining room with a fantastic open fireplace.\nWalk out to a private city garden terrace. The kitchen is open, fully fitted with all modern touches - a chefs dream! There are 2 large bed rooms and 2 baths , a laundry room, and guest WC.The closets are built in and very spacious. There is a garage and storage space. The property is ideally situated between NATO and the EU area, very close to the Diamant metro, shops, restos and parcs.\nPEB D. Charges are 250€/mo including water, electricity, common charges.\nFor info and visits call 0485271082'),
(2781, 'fra', 'Property', 204, 'desc', 'A Schaerbeek a cote de WSL - ce loft est un trésor! L\'intérieur a été conçu par un architecte et chaque détail est parfait! Entrez dans une immense salon / salle à manger avec un fantastique feu ouvert. Terrasse /  jardin privé. La cuisine est ouverte, équipée de toutes les touches modernes - un rêve! Il y a 2 grandes chambres à coucher et 2 salles de bains, une buanderie. Les placards sont intégrés et très spacieux. Il y a un garage et une cave. Le bien est idéalement située entre l\'OTAN et la zone européenne, tout près du métro Diamant, des magasins, des restos et des parcs.\nPEB D. Charges de 250 € / mois, y compris l’eau, l’électricité, les charges communes. Pour info et visites tel:  0485271082'),
