(2841, 'fra', 'Property', 211, 'desc', 'Au rez-de-chaussée d\'une maison de maître, entièrement rénovée avec goût et charme. Le hall d’entrée mène à un grand salon, une salle à manger avec accès au jardin / terrasse et une cuisine américaine entièrement équipée. En bas se trouve un WC séparé, une belle grande douche avec double évier, 2 grandes chambres à coucher, beaucoup de lumière naturelle et placards encastrés. Cet appartement est idéalement situé dans le quartier le plus élégant d’IXELLES, près du Châtelain, dans une rue calme à proximité des commerces, des parcs et des transports en commun. L\'appartement dispose de plancher en parquet et de fenêtres à double vitrage. PEB C. Pour informations et visites, appelez le 0485 27 10 82'),
(2842, 'eng', 'Property', 211, 'desc', 'On the main floor of a \"Maison de Maitre\", fully renovated with taste and charm: Enterance hall leades into a large living room, a dining room with access to the garden/terrace and an open plan, fully fitted kitchen. Downstairs is seperate WC, a beautiful large shower with double sinks, 2 big bedrooms, lots of natural light and built in closets. This flat is ideally located in the most elegant part of IXELLES, near Chatelain, on a quiet street close to shops, parcs and public transport. The flat has hard wood floors, tiles and double glazed windows. PEB C. For info and visits call 0485 271 082'),
