(2922, 'eng', 'Property', 220, 'desc', 'Beaux-Arts style house from 1912, (Architect Jos EVRARD) unique in its beauty, charm and historical value. \nPerfect marble entrance leads to an elegant lobby with a majestic staircase. Living and dining room of 65m² with original fireplaces, tapestries, stained glass windows, and\nglass doors that lead to the enchanted courtyard of 50m². Downstairs, a large kitchen (to be updated), a guest room/office, a laundry room, a WC and many cellars. \nOn the 1st and 2nd floors: 4 huge bedrooms, 2 large bathrooms, balconies ... In excellent condition, ideally located close to shops, restaurants, parks and public transport. PEB E +'),
(2923, 'fra', 'Property', 220, 'desc', 'Maison de style Beaux-Arts de 1912 (architecte Jos EVRARD) unique par sa beauté, son charme et sa valeur historique.\nL\'entrée en marbre parfaite mène à un hall élégant avec un escalier majestueux. Salon et salle à manger de 65m² avec cheminées, tapisseries, vitraux et\nportes vitrées qui mènent à la cour enchantée de 50m². En bas, une grande cuisine (à rafraîchir), une chambre d’amis / bureau, une buanderie, un WC et de nombreuses caves.\nAu 1er et 2ème étages: 4 grandes chambres, 2 grandes salles de bain, balcons ... En excellent état, idéalement situé à proximité des commerces, des restaurants, des parcs et des transports en commun. PEB E +'),
