(3005, 'eng', 'Property', 229, 'desc', 'Modern, elegant and bright: this spacious duplex has an open living and dining room, a 15m² terrace, a fully fitted kitchen, guest WC, closet and laundry room. There are 3 bedrooms, one with an en-suite bath room and the other 2 bedrooms are upstairs sharing the second bathroom. There is an open space mezzanine, ideal for an office, a basement storage area and a parking spot for 100€/mo. All in excellent condition with hardwood floors, double glazed windows, ideally situated near shops, restaurants, public transport NATO, and walking distance to the \"Geneve\" commission buildings. PEB is D-.'),
(3006, 'fra', 'Property', 229, 'desc', 'Moderne, élégant et lumineux: ce spacieux duplex dispose d\'un salon / salle à manger ouvert, d\'une terrasse de 15 m², d\'une cuisine entièrement équipée, un WC invités et une buanderie. Il y a 3 chambres à coucher, une avec une salle de bain attenante, les 2 autres chambres sont à l\'étage avec la 2e salle de bain. Il y a une mezzanine, idéale pour un bureau, une cave et une place de parking pour 100 € / mois. Le tout en excellent état avec parquet, fenêtres double vitrage. Idéalement situé à proximité de magasins, restaurants, transports en commun et de l\'OTAN. PEB D-.Pour info et visites appeler Sonja +0032 485 271 082 (EN, FR, DE, IT)'),
