(3012, 'fra', 'Property', 230, 'name', 'Meublé - Loft 3 ch avec terrasse!'),
(3013, 'eng', 'Property', 230, 'desc', 'In the very heart of Brussels, a stone\'s throw from the Opera and the Grand Place, bright, spacious, split-level loft. Enter through a common courtyard, elevator to the third floor, the flat opens onto a large, living and dining room with an open fire place and fully fitted modern kitchen. There are 2 bed rooms on this level, 2 bath rooms (one with shower one with tub), lots of storage space, and a laundry area. Upstairs to the 3rd bedroom/office/fitness space, with skylights and access to the lovely private terrace. The appartment itself is surprisingly calm, quiet and very secluded, while surrounded by all the high street shops, restaurants, bars, metro DeBrouckere and everything Brussels has to offer. PEB E. For information and visits please call +0032 485 271 082\n250 € of charges include common charges, heat, water, and electricity!'),
(3014, 'fra', 'Property', 230, 'desc', 'Au coeur de Bxl - Duplex lumineux, spacieux et calme. Entrée par une cour commune, au 3e étage, avec ascenseur, l\'appartement s\'ouvre sur un grand salon et salle à manger avec feu ouvert et cuisine moderne équipée. 2 chambres, 2 salles de bain, amples espaces de rangement et buanderie. A l\'étage 3ème chambre /bureau , avec puits de lumière et accès à la belle terrasse privée. L\'appartement et très calme et isolé, tout en étant dans un quartier vibrant, proche de magasins, restos, bars et du métro De Brouckère... PEB E charges 250€ par mois inclusives de chauffage, eau et électricité. Pour info et visites appeler +0032 485 271 082 (EN, FR, DE, IT)'),
