(3020, 'fra', 'Property', 231, 'desc', 'Limite BXL 1000, à côté de l\'emblématique Basilique de Koekelberg ce loft génial était autrefois une chocolaterie. Il est lumineux et spacieux avec un grand salon ouvert, une salle à manger et une cuisine entièrement équipée, de nombreux puits de lumière, plusieurs terrasses, un WC visiteurs, 3 chambres à coucher, une salle de bains avec douche et une avec baignoire, ainsi qu\'un magnifique espace mezzanine idéal pour une bureau ou chambre d\'amis. Il y a des planchers en bois et des fenêtres à double vitrage, une zone de stockage au sous-sol et un emplacement de parking. La propriété a également accès à une piscine intérieure et à une salle de sport. Confortablement situé près de la station de métro Simonis, à proximité de l’école européenne'),
(3021, 'eng', 'Property', 231, 'desc', 'In 1081 - KOEKELBERG, next to 1000 Bxl and the iconic Basilique, this awesome loft was formerly a chocolate factory. It’s bright and spacious with a large, open plan living, dining room and fully fitted kitchen, lots of skylights, several terraces, a guest WC, 3 bedrooms, a bathroom with shower and one with a bathtub, and wonderful mezzanine space ideal for an office or guest room. There are hard wood floors and double-glazed windows, a basement storage area and a parking spot. The property also has access to an indoor pool and fitness area. Ideally situated at the Simonis Metro stop, close to the EEB4, shops and restaurants.  PEB E'),
