(3037, 'eng', 'Property', 233, 'desc', 'Ixelles - Defacqz - Close to Av Louise and Place du Châtelain, 1 bedroom apartment on the 1st floor in a building of 20 units. It consists of: entrance hall with cloakroom, wc with washing machine, living room with fully equipped open kitchen, bathroom and bedroom. Cellar in the basement. Double glazing and electricity compliant. Possibility to buy furnished. PEB C+. Info and visits Alessandro Meschi 0496 20 22 63'),
(3038, 'fra', 'Property', 233, 'desc', 'Ixelles – Defacqz – A deux pas de la Av Louise et de la Place du Châtelain, appartement 1 chambre au 1er étage dans un bâtiment de 20 unités. Il se compose de:  hall d\'entrée avec vestiaire, wc avec emplacement machine à laver, living avec cuisine ouverte super équipée, salle de bain et chambre. Cave au ssol.  Double vitrage et électricité conforme. Possibilité achat meublé. PEB C+. Info et visite Alessandro Meschi 0496 20 22 63'),
