(3056, 'eng', 'Property', 235, 'desc', 'Charming home in the Roman countryside only 20 mins north of the city. 110M² villa built in 2005. 600m² garden with olive trees, and lots of privacy. Open space main floor with built in fitted kitchen, living and dining room, laundry, storage... Upstairs to 2 bdrs and a 2nd full bathroom. Parquet floors and terracotta tiles, air conditioning, efficient gas heating ... Great location near all the shops. Ideal as a retirement home, vacation home or as an investment...PEB underway'),
