(3062, 'eng', 'Property', 236, 'desc', 'Tubize - In a quiet street, 200mt from the train station, large apartment of +/- 93m² with 2 bedrooms on the 1st floor in a small co-owenrship.\nIt consists of: entrance with cupboard, large living room with open fully equipped kitchen (45m²), night hall, first bedroom (18m²), second bedroom (13m²) and large shower room (renovated in 2019). Cellar and two parking spots included in the price. The apartment was fully renovated in 2013 and the bathroom in 2019. PEB B kWh / m² / year 144. Info and visits Alessandro Meschi 0496202263'),
(3063, 'fra', 'Property', 236, 'desc', 'Tubize – Dans une rue calme, à 200mt de la gare, spacieux appartement de +/- 93m² avec 2 chambres au 1er étage dans une petite copropriété.\nIl se compose de: entrée avec placard, grand séjour avec cuisine ouverte full équipée (45m²), halle de nuit, première chambre (18m²), deuxième chambre (13m²) et grande salle de douche (rénovée en 2019). Cave et deux emplacements parking compris dans le prix. L\'appartement a été rénove en profondeur en 2013 et la salle de douche en 2019. Chauffage individuel avec chaudière à condensation. PEB B kWh/m²/an 144.  Info et visites Alessandro Meschi 0496202263'),
