(3080, 'eng', 'Property', 238, 'desc', 'Ixelles - On Place Stéphanie, with a beautiful view, in a magnificent building from the 1930s, beautiful apartment of +/- 223 m² located on the 1st floor. It consists of: large living room, fully equipped kitchen, 2 bedrooms and an office, 2 bathrooms and 2 cellars. Electricity on conformity, recent renovation. PEB E-. Info and visits Alessandro Meschi 0496 20 22 63'),
(3081, 'fra', 'Property', 238, 'desc', 'Ixelles - Sur la Place Stéphanie,avec belle vue, dans un magnifique immeuble des années 30 , bel appartement de +/- 223 m² situé au 1er étage. Il se compose de: grand salon, cuisine super équipée, 2 chambres et un bureau, 2 salles de bains et 2 caves. Électricité conforme, rénovation récente. PEB E-. Info et visites Alessandro Meschi 0496 20 22 63'),
