(3096, 'fra', 'Property', 240, 'name', '2 Chambres plus box parking'),
(3097, 'fra', 'Property', 240, 'desc', 'Lumineuse, spacieuse et complètement rénové  Hall d\'entrée donne sur un salon / salle  à manger avec une magnifique cuisine ouverte. 2 chambres, salle de bains, wc séparé, laveuse, sécheuse et placards intégrés. Double vitrage, planché en bois massif, terrasse, cave et box garage. Charges 200 € : chauffage, l’eau, l’électricité commune et les charges communs... Location idéal avec des magasins, parcs et des restaurants à votre porte, ainsi que le métro Tomberg et la piscine Poséidon ... Le PEB C-'),
(3098, 'eng', 'Property', 240, 'desc', 'Bright, spacious and completely renovated Entrance hall leads into a living / dining room with a magnificent open kitchen. 2 bedrooms, bathroom, separate wc, washer, dryer and built-in cupboards. Double glazing, solid wood flooring, terrace, cellar and garage box. Charges 200 €: heating, water, common electricity and common charges ... Ideal rental with shops, parks and restaurants on your doorstep, as well as the Tomberg metro and the Poseidon swimming pool ... The PEB C -'),
