(3103, 'fra', 'Property', 241, 'name', 'EU - Superb Triplex'),
(3104, 'eng', 'Property', 241, 'desc', 'Brussels EU - In the heart of the European district, 50 mt from the Cinquantenaire park, in an elegant Hotel de Maitre (10mt facade), superb triplex with large garden (100m2), terrace (30m2) and garage. It consists on the ground floor of: entrance hall, three rooms in a row with access to the garden, separate kitchen with dining room with also access to the garden, guest toilet, garage and large super well-maintained garden of +/- 100 m2 with fountain and lighting. On the 1st floor: Master bedroom with private dressing and en-suite bathroom,  a large second bedroom which leads to the terrace of +/- 30m2,  a second bathroom and a third bedroom (currently used as an office)  also with access to the terrace. The half-basement consists of: guest bedroom, shower room, large laundry room with boiler, 2 cellars. Double glazing everywhere, excellent general condition. Property very difficult to find !!! PEB F. Info and visits Alessandro Meschi 0496 20 22 63'),
(3105, 'fra', 'Property', 241, 'desc', 'Bruxelles EU – Au plein coeur du quartier européen, à 50 mt du parc du Cinquantenaire, dans un élégant hôtel de maître (façade 10mt), superbe triplex avec grand jardin (100m2), terrasse (30m2) et garage. Il se compose au RDC de: hall d\'entrée, trois pièces en enfilade avec  accès au jardin, cuisine séparée avec salle à manger avec aussi accès au jardin, wc invité, garage et grande jardin super bien entretenu de +/- 100 m2 avec fontaine et illumination. Au 1er étage on trouve: la chambre principale avec dressing et salle de bain en suite, la deuxième grande chambre qui mène à la terrasse de +/- 30m2, une salle de bain privé et la troisième chambre qui mène aussi à la terrasse (actuellement utilisée comme bureau). Le mi-sol se compose de: chambre invitées, salle de douche, grande buanderie avec local chaudière, 2 caves. Double vitrage partout, excellent état général. Bien très difficile à trouver !!! PEB F. Info et visites Alessandro Meschi 0496 20 22 63'),
