(3124, 'eng', 'Property', 243, 'desc', 'Brussels center - Next to Place St Catherine, in the historic center of Brussels, on the top floor of a character building, magnificent one bedroom duplex with attic converted into 4 bedrooms, this means a total of 5 bedrooms, 1SDB and 1SDD. The apartment was renovated in 2017, offering an area of 200m2 including 165m2 of living space. On the 1st level: large living room with 4 balconies, fully equipped kitchen, bedroom of 20m2 with dressing area, bathroom, guest WC. On the 2nd level: attics currently converted into 4 bedrooms, a shower room with laundry area and 1 WC. Under the roof, a storage attic of 16m2. PEB G. Info and visits Alessandro Meschi 0496 20 22 63'),
(3125, 'fra', 'Property', 243, 'desc', 'Bruxelles centre - A coté de la Place St Catherine, dans le centre historique de Bruxelles, au dernière étage d’un immeuble de caractère, magnifique duplex d\'une chambre avec Grenier aménagé en 4 chambres, cette a dire un total de 5 chambres, 1SDB et 1SDD. L\'appartement a été énové en 2017,  offrant une superficie de 200m2 dont 165m2 habitables. Au 1er niveau : grand living avec 4 balcons, cuisine full équipée, chambre de 20m2 avec espace dressing, salle de bain, WC invité. Au 2ème niveau : greniers actuellement aménagés en 4 chambres, une salle de douche avec espace buanderie et 1 WC. Sous le toit, un grenier de rangement de 16m2.PEB G. Info et visites Alessandro Meschi 0496 20 22 63'),
