(3134, 'eng', 'Property', 244, 'desc', 'Schaerbeek - Place Meiser, in a building from the 70s, on the 1st floor apartment of +/- 90m2. It consists of: entrance hall, living room, separate kitchen with small bacon, two bedrooms, one with another small balcony, separate wc and bathroom. Provide renovation work. PEB F. Info and visits Alessandro Meschi 0496 20 22 63'),
