(3144, 'fra', 'Property', 245, 'desc', '140m² : Hall d\'entrée +WC, séjour lumineux avec bureau et étagères intégrées. Cuisine entièrement équipée avec salle à manger attenante.3 chambres à l\'étage: 2 salle de bains, dressing, machine à laver et sechoir, planchers en bois, fenêtres à double vitrage, porte blindée, vidéophone, chauffage central et grenier avec grands espaces de rangements… PEB F.\nProvision charges €150/mo'),
(3145, 'eng', 'Property', 245, 'desc', 'Next to Woluwe Park, on one of the most beautiful quiet residential streets in Chant d’Oiseau near Av de Tervuren and Montgomery.\nEntrance hall with WC, stairs to bright living room with office and built-in shelves. Fully equipped kitchen with adjoining dining room. 2 bedrooms and extra office or baby room upstairs. Master bedroom has an en-suite Shower, WC and separate dressing room. 2nd full bathroom for the other 2 rooms. Hard wood floors, washer and dryer, double glazed windows, security door, video intercom, central heating, and attic storage. Safe and quiet area, close to public transport, shops, parcs and weekly evening market in the square, PEB F. Provision of charges 150€/mo'),
