(3157, 'fra', 'Property', 247, 'name', 'Passive Furnished Fab'),
(3158, 'eng', 'Property', 247, 'desc', 'Perfection! Furnished Passive 1 bdr flat\nFully Furnished flat of 68m² where every detail is beautifully renovated with modern style and luxury. Bright living room, fully fitted kitchen, 1 bedroom, elegant shower and bath, separate WC, washer/dryer and balcony. Ideally located on a lovely street, safe and quiet while close to public transport, shops, restaurants - Place Brugmann and Châtelain. PEB (Pre Passive renovations!) G'),
(3159, 'fra', 'Property', 247, 'desc', 'La perfection ! Appartement meublé passif de 1 ch. \nEntièrement meublé de 68 m² où chaque détail est magnifiquement rénové avec style moderne et luxe. Séjour lumineux, cuisine entièrement équipée, 1 chambre, douche et baignoire élégantes, WC séparés, laveuse / sécheuse et balcon. Idéalement situé sur une jolie rue, sûre et calme tout en étant proche des transports en commun, commerces, restaurants - Place Brugmann et Châtelain. PEB (Rénovations Pré Passives!) G'),
