(3164, 'fra', 'Property', 248, 'name', '1030 trendy'),
(3165, 'eng', 'Property', 248, 'desc', 'Beautiful 2 or 3 bdr flat\nIn the trendy and safe part of Schaerbeek, at park Josephat - lovely, bright 2 or 3 bedroom flat with fully fitted modern kitchen, 2 charming balconies, high ceilings, original wood floors and space for your bike! Great location close to public transport, shops and restaurants. Easy bike ride to Nato or the EU Schuman area. Above the neighborhood bar “1030” which is very respectful of the quiet residential area and their nice neighbours.'),
(3166, 'fra', 'Property', 248, 'desc', 'Bel appartement de 2 ou 3 ch\nDans une zone branchée et sûre de Schaerbeek, près du parc Josaphat - bel appartement lumineux de 2 ou 3 chambres avec cuisine moderne entièrement équipée, 2 balcons charmants, de hauts plafonds, des planchers en bois d\'origine et de l\'espace pour votre vélo! Excellent emplacement à proximité des transports publics, des magasins et des restaurants. Déplacement à vélo facile vers l\'OTAN ou la zone Schuman de l\'UE. Au-dessus du bistrot de quartier \"1030\" très respectueux du quartier résidentiel calme et de ses bons voisins.'),
