(3172, 'eng', 'Property', 249, 'desc', 'Fully renovated, bright and very tastefully done, on the 3rd and 4th floor of a charming \"maison de maitre\" from 1912. Over 130m² the property includes entrance area, living/dining room, fully fitted modern kitchen that opens onto an enormous terrasse, large bedroom, a full bathroom with shower and bathtub, and a built in dressing area. Upstairs to the spacious master bedroom with an en-suite bathroom with shower. Beautifully finished hard wood floors, lovely tiles, marble and double-glazed windows. Individual gas heating, 2 basement storage rooms, no elevator. In a wonderful location close to shops, restaurants and public transport. PEB G. Common charges of +/- 55€/month. For info and visits call +32 485 271 082'),
(3173, 'fra', 'Property', 249, 'desc', 'Penthouse meublé, entièrement rénové, lumineux et aménagé avec beaucoup de goût, au 3e et 4e étage d\'une charmante maison de maître de 1912, sans ascenseur. Sur 130 m² la propriété comprend : entrée, séjour / salle à manger, cuisine moderne entièrement équipée ouvrant sur une immense terrasse. Une grande chambre à coucher, une salle de bain avec douche et baignoire, et un dressing intégré. A l\'étage, la spacieuse chambre principale avec une salle de douche et wc. Parquet magnifique, beau carrelages, marbre, et fenêtres à double vitrage. Chauffage individuel au gaz, 2 caves en sous-sol. Dans un endroit merveilleux à proximité des commerces, restaurants et transports en commun. PEB G. Charges communes de +/- 55 € / mois. Pour informations et visites Sonja +32 485 271 082'),
