(3198, 'fra', 'Property', 252, 'name', 'Michel Ange'),
(3199, 'eng', 'Property', 252, 'desc', 'Brussels EU area - Superb « Maison de maitre » close to Schumann and the Parc du Cinquantenaire in the beautiful Av Michel Ange. The house of 345 M2 is on 4 levels plus cellars, exterior courtyard plus small room ideal as home office or profession or gym. On the ground floor: entrance hall which leads to the separate fully equipped kitchen with dumb waiter directly to the dining room on the 1st floor, a guest WC and an office. Access to the outdoor courtyard via the kitchen. On the 1st floor, wonderful dining room and living room with decorative fireplace and built-in period furniture. 2nd floor: family room or bedroom, bathroom and a second bedroom. On the 3rd floor, master suite with large bedroom, bathroom and dressing room. Additionally, an attic, cellar, laundry room and boiler room. The house has been completely renovated and restored with taste and while respecting the original charm.\nInfo and visits Alessandro Meschi 0496202263'),
(3200, 'fra', 'Property', 252, 'desc', 'Bruxelles Eu – Superbe Maison de maitre situé à deux pas de Schumann et du Parc du Cinquantenaire dans la merveilleuse Av Michel Ange. La maison de 345 M2 disposée sur  4 niveaux plus caves, cour extérieure et petit pièce espérée idéale pour profession libérale où petite gym privative. Elle se compose de: RDC, hall d’entrée qui amène  à la cuisine séparée super équipée avec monte-charge direct vers la salle à manger au 1er étage, WC  invités et bureau. Accès à la courte extérieure via la cuisine et pièces supplémentaire. Au 1er étage, merveilleuse salle à manger avec grande cheminée et meuble de l’époque et salon. Au 2eme étage: salle télé ou chambre, salle de bain et une deuxième chambre. Au 3eme et dernier étage, suite principale avec grande chambre à coucher, salle de bain privative et dressing. Grenier, cave, buanderie et local chaudière. La maison a été complètement rénovée et aménagée avec grand gout en respectent le charme d’origine. \nInfo et visites Alessandro Meschi 0496202263'),
(3201, 'eng', 'Property', 252, 'key_feature_1', ''),
