(3208, 'fra', 'Property', 253, 'name', 'Overijse Villa'),
(3209, 'eng', 'Property', 253, 'desc', 'Overijse - Jesus Eik - Superb villa on two floors plus basement of +/- 280m2, with large fenced garden (1000m2) and two garages. It consists on the ground floor: entrance hall, large living room, dining room, fitted kitchen, office and wc. On the 1 and floor 4 bedrooms, 3 bathrooms and WC., 2 garages, 2 cellars and boiler room. PEB 265kWh / year. Info and visits Alessandro Meschi 0496 20 22 63'),
(3210, 'fra', 'Property', 253, 'desc', 'Overijse – Jesus Eik – Superbe villa de caractère sur deux étages plus ssol de +/- 280m2,  avec grand jardin clôturé (1000m2) et deux garages. Elle se compose au RDC : hall d’entrée, grand séjour, salle à manger, cuisine équipée, bureau et wc. Au 1 et étage  4 chambres, 3 salles de bain et WC. Griener accessible, 2 garages, 2 caves et local chaudière. PEB 265kWh/an. Info et visites Alessandro Meschi 0496 20 22 63'),
(3211, 'eng', 'Property', 253, 'key_feature_1', ''),
