(3218, 'fra', 'Property', 254, 'name', 'VENDU !!! Franklin'),
(3219, 'eng', 'Property', 254, 'desc', 'SOLD !!! Bruxelles EU - Schuman – Classic Town house very brightful of +/- 293m² on 4 levels plus basement, garage and garden. It is made up on the ground floor entrance hall, 3 rooms in a row and fully equipped kitchen. On the mezzanine, WC and laundry room. 2 bedrooms and bathroom on the 1st floor with platform, 2 bedrooms (or master bedroom with dressing room) plus shower room and separate WC on the 2nd floor. On the 3rd floor: two bedrooms, one with mezzanine and bathroom. In the basement: access to the garden and terrace, workshop, wine cellar and 2 cellars. 1 car garage. PEB D. Info and visits Alessandro Meschi 0496 20 22 63'),
(3220, 'fra', 'Property', 254, 'desc', 'VENDU !!! Bruxelles EU – Schuman - Maison de maître de caractère et très lumineuse de +/- 293m² sur 4 niveaux plus ssol, garage et jardin. Elle se compose au RDC hall d\'entrée, 3 pièces en enfilade et cuisine super équipée. A l\'entresol WC et buanderie. 2 chambres et salle de bain au 1er étage avec plate-forme, 2 chambres (ou chambre parentale avec dressing) plus salle de douche (douche à l’italienne) et WC séparée au 2eme étage. Au 3 eme étage: deux chambres dont une avec mezzanine et salle de bain. Au ssol: accès au jardin et terrasse, atelier, cave à vin, cave et cave au charbon. Garage 1 voiture. PEB D. Info et visites Alessandro Meschi 0496 20 22 63'),
(3221, 'eng', 'Property', 254, 'key_feature_1', ''),
