(3229, 'eng', 'Property', 255, 'desc', 'Brussels EU - Commercial / office space in the heart of the European district of +/- 85m2 on two levels completely renovated. On the ground floor entrance with small kitchen and magnificent glass slab which gives a lot of light to the basement, shower room with WC, room at the back with storage room. In the basement, large room with separate WC, shower and laundry room. The property is in a recently renovated small building with very low charges. Info and visits Alessandro Meschi 0496202263'),
(3230, 'fra', 'Property', 255, 'desc', 'Bruxelles EU -  Espace commercial/bureau au cœur du quartier Européen de +/- 85m2 sur deux niveau complètement rénové. Au RDC entrée avec petite cuisine et magnifique dalle en verre qui donne beaucoup de luminosité au ssol, salle de douche avec WC, pièce à l’arrière avec débarra. Au ssol, grande pièce avec WC séparé, douche et buanderie. Le bien se trouve dans une petite copropriété récemment rénovée avec des charges très faibles. Info et visites Alessandro Meschi 0496202263'),
