(163, 205, 'en', '3 Bd Evere', 'Evere - Sublime penthouse fully furnished on the third floor with elevator of a small building with superb terrace of 25m ². It offers an entrance hall, a spacious living room, a beautiful fully equipped kitchen. 3 bedrooms, a bathroom, a shower room, a separate toilet, a laundry, a cellar, indoor parking. Air conditioning, double glazing with ventilation system and security door. Info and visits Alessandro Meschi 0496 20 22 63', '', NULL, NULL),
(164, 205, 'fr', '3 ch Evere', 'Evere - Sublime penthouse complètement meublé au troisième étage avec ascenseur d’une petite copropriété avec superbe terrasse de 25m². Il offre un hall d\'entrée, un salon spacieux, une magnifique cuisine hyper équipée. 3 chambres, une salle de bain, une salle de douche, une toilette séparée, une buanderie, une cave, un parking intérieur. Air conditionné, double vitrage avec système d’aération et porte blindée. Info et visites Alessandro Meschi 0496 20 22 63', 'assdfgh', 'asdfgghhj', 'fghhjdssd'),
