INSERT INTO `property_translations_copy` (`id`, `property_id`, `locale`, `name`, `short_desc`, `key_feature_1`, `key_feature_2`, `key_feature_3`) VALUES
(1, 103, 'eng', NULL, 'English desc', NULL, NULL, NULL),
(2, 103, 'fra', NULL, 'French desc', NULL, NULL, NULL),
(3, 112, 'eng', 'Everbergh', 'EVERBERG-KORTENBERG superbe villa de +/- 300m² avec terrain de +/- 3000m². Elle se compose: hall d\'entrée avec vestiaire, grande cuisine super équipée avec coin à déjeuner, double salon avec feu ouvert, salle a manger, sdd avec WC, 2 chambres (possibilité profession libérale) et plusieurs accès au jardin. Au1er étage: hall de nuit, 2 chambres, salle de bains, master bedroom (suite) avec avec dressing, salle de bains. Grenier aménageable. Garage pour deux voitures avec porte automatique au ssol plus cave, salle de jeux avec feu ouvert, salle de douche avec WC et buanderie. Deuxième garage 2 voitures à l’extérieur. Chaudière au gaz, double vitrage pare-balles et finitions de haute qualité.PEB 228kWh/m². Info et visite Alessandro Meschi 0496 20 22 63', NULL, NULL, NULL),
(4, 112, 'fra', 'Everbergh', 'Excellent condition, spacious and comfortable villa of +/- 300m² surrounded by a fantastic +/- 3000m .garden. It consists of entrance hall with cloakroom, large fitted kitchen with breakfast area, double living room with fireplace, dining room , shower room with WC, 2 bedrooms/offices. On 1st floor : hall , 2 bedrooms , bathroom , master suite with dressing room and bathroom . Attic with potential to convert to more living space. Two-car garage with automatic door to cellar, game room with fireplace, shower room with toilet and laundry . Second seperate 2 car garage. Gas boiler , double glazed windows and high quality finishings. PEB 228kWh/m². For info and visits Sonja: 0485 27 10 82 or Alessandro : 0496 20 22 63', NULL, NULL, NULL),
(5, 116, 'eng', 'Duplex EU', 'European district - Very nice and renovated furnished apartment of 60m² on the 2nd floor in a small house. Living room with equipped kitchen, large bedroom with wardrobe, bathroom with tub and washing machine, spacious attic with sofa-bed for guests or to use as a 2nd room, internet and TV included. Info and visits Alessandro Meschi 0496 20 22 63', 'All charges inc 150', NULL, NULL),
(6, 116, 'fra', 'Duplex EU', 'Quartier Européenne – Très jolie appartement de 60 m² entièrement rénové et meublé et équipée, situé au 2eme  étage dans une petite maison. Living avec cuisine super  équipé, grande chambre double lit avec armoire, salle de bain avec baignoire et machine a laver, mezzanine spacieux avec canapé lit pour les invites ou à utiliser comme 2eme chambre, abonnement   internet et TV compris.', NULL, NULL, NULL),
(7, 131, 'eng', 'Lovely 1 bdr', NULL, NULL, NULL, NULL),
(8, 131, 'fra', 'Appartement de charme', 'Appartement élégant sur une des plus belles avenues de Schaerbeek. 1er étage d\'une belle maison bruxelloise, parfaitement restauré, grand et lumineux appartement une chambre avec un bureau, cuisine moderne équipée, salon et salle à manger, et mezzanine pour 2ème lit. Hauts plafonds, moulures, parquet, double vitrage, balcon à l\'avant et la possibilité de créer une magnifique terrasse à l\'arrière. Electricité conforme, volets à l\'arrière, compteurs individuels, chaudière au gaz. Très bien situé à proximité des transports en commun, des parcs, des restaurants et des magasins ainsi que l\'EEB4 et l\'OTAN. \'PEB D\'. Pour informations et visites tel Sonja +32 (0) 485 271 082', NULL, NULL, NULL),
(9, 143, 'eng', 'corrado', 'This superb 260m² duplex is on the 1st and 2nd floor of a wonderful \"maison de maitre\" in upper  Schaerbeek, near Wolumé. Large entrance hall, beautiful living room, dining room, study,  fireplace, modern fitted kitchen with breakfast area which opens onto a large terrace and private flower garden. Upstairs; 3 large bright bedrooms, 2 bathrooms and a dressing room. In the basement; 2 large cellars. Possible to sublet private parking for 120 € / month. Close to public transport, shops, restaurants, parks and the EU institutions. PEB is under way. Info/visits Sonja 0485271082', NULL, NULL, NULL),
(10, 143, 'fra', 'corrado', 'Ce superbe duplex de 260 m² est au 1er et 2ème étage d\'une merveilleuse maison de maître dans le haut de Schaerbeek, limite Woluwé. Grand hall d\'entrée, belle salle de séjour, salle à manger, bureau avec feu ouvert, cuisine moderne équipée avec coin repas qui ouvre sur une grande terrasse et jardin fleuri privé. À l\'étage; 3 grandes chambres lumineuses, 2 salles de bains et un dressing. Au sous sol; 2 grand caves. Possible de sous-louer un parking privé pour 120€/mois. A proximité de transports en publiques, magasins, restaurants, le prestigieux Institut de la Vierge Fidèle, le parc du 50aire et les institutions EU. PEB est en cours.Info/visites Sonja 0485271082', NULL, NULL, NULL),
(11, 144, 'eng', 'claes', 'Rénovation 5 étoiles dans cette belle maison de maître, au cœur du quartier chic des galléries d\'art/Chatelain. Très lumineux, au 3ème et 4ème étage, l\'appartement se compose d\'un hall d\'entrée, une cuisine américaine très bien équipée, salon / salle à manger avec bibliothèque. A l\'étage, belle chambre avec balcon et salle de bains. Cave. Proche des commerces, des restaurants et des transports en commun. Info et visites Sonja 0485271082', NULL, NULL, NULL),
(12, 144, 'fra', 'claes', 'Rénovation 5 étoiles dans cette belle maison de maître, au cœur du quartier chic des galléries d\'art/Chatelain. Très lumineux, au 3ème et 4ème étage, l\'appartement se compose d\'un hall d\'entrée, une cuisine américaine très bien équipée, salon / salle à manger avec bibliothèque. A l\'étage, belle chambre avec balcon et salle de bains. Cave. Proche des commerces, des restaurants et des transports en commun. Info et visites Sonja 0485271082', NULL, NULL, NULL),
(13, 171, 'fra', 'Duplex EU', 'European District - Charming apartment, 70 m², renovated, 3rd floor,. 1 bedroom, 1 spacious bathroom, large living room, fully equipped kitchen (dishwasher, microwave, oven, fridge), completely furnished. Separate laundry area and washing machine.\nCharges 100 € including: electricity, heating, water, satellite TV. PEB D+\nInfo and visits Alessandro Meschi 0496202263', NULL, NULL, NULL),
(14, 171, 'eng', 'Duplex EU', 'Quartier Européenne –  Charmant appartement, 70 m², rénové, 3ème étage, dans maison de maître +/-80 mt², 1 confortable chambre à coucher, 1 spacieuse salle de bain, grand salon et living, grande cuisine super équipée (lave-vaisselle, four micro-onde, four, frigo), complètement meublé. Espace buanderie et machine à laver séparés.\nCharges 100€ comprenant: électricité, chauffage, eau, TV satellitaire. PEB D+\nInfo et visites Alessandro Meschi 0496202263', NULL, NULL, NULL),
(15, 172, 'eng', 'Watermael', 'In a residential area, in a 70\'s building with swimming pool and conference romm, large apartment on the 8th floor with elevator with superb view. +/- 115 m², it consists of: entrance hall, living room, separate kitchen, 2 bedrooms, 1 shower room, 1 bathroom, toilet and dressing. All rooms have access to the terrace. The apartment has just been refreshed. Peb F. Info and visits Alessandro Meschi 0496202263', 'Charges 250', NULL, NULL),
(16, 172, 'fra', 'Watermael', 'Dans un quartier résidentiel, dans un bâtiment année 70 avec piscine et salle de réunion, grand appartement au 8eme étage avec ascenseur avec superbe vue. +/- 115 m², il se compose de: hall d\'entrée, living, cuisine séparée, 2 chambres, 1 sdd, 1 sdb, WC et dressing. Toutes les pièces ont accès à la terrasse. L\'appartement vient d’être rafraîchi. Peb F. Info et visites Alessandro Meschi 0496202263', 'Charges 250', NULL, NULL),
(17, 193, 'eng', 'Livourne', 'Close to the Place du Châtelain, in a building of the 30s, superb apartment of + / - 275m² on the 3rd floor. It consists of entrance hall, large and bright living room with fireplace, fully equipped kitchen, 4 bedrooms (35-20-16-12 m²) including the master bedroom with dressing room and private bathroom, 3 bathrooms, laundry room and many cupboards. Double glazing, parquet floor and elevator. Cellar in the basement. Info and visits Alessandro Meschi 0496202263', 'Charges 500€', NULL, NULL),
(18, 193, 'fra', 'Livourne', 'A deux pas de la Place du Châtelain, dans un immeuble des années 30, superbe appartement de +/- 275m² au 3eme étage. Il se compose de hall d\'entrée, grand et lumineux living en deux pièces avec feu ouvert, cuisine super équipée, 4 chambres (35-20-16-12 m²) dont la master bedroom avec dressing et sdd privé, 3 sdb, buanderie et nombreux placards. Double vitrage, parquet au sol et ascenseur. Cave au sssol. Info et visites Alessandro Meschi 0496202263', 'Charges 500€', NULL, NULL),
(19, 195, 'eng', 'Jourdan', 'St Gilles - Next to the Av Louise 250 meters from the stop of the Metro Louise, in a very lively area with lots of shops and restaurants in a small condominium, apartment on the 1st floor completely renovated and furnished with 2 bedrooms. It consists of large living room, separate dining room, fully equipped kitchen, utility room with washing machine, 2 bedrooms and bathroom. Individual heating, double glazing and no charges. PEB F Info and visits Alessandro Meschi 0496202263', 'no charges', NULL, NULL),
(20, 195, 'fra', 'Jourdan', 'St Gilles – A coté de l\'Av Louise à 250 métrés de l’arrête du Métro Louise, dans un quartier très vivant avec beaucoup de commerces et restaurants dans une petite copropriété, appartement au 1er étage complètement rénové et meuble avec 2 chambres.  Il se compose de grand séjour, salle à manger séparée, cuisine super équipée, arrière cuisine avec machine à laver, 2 chambres et salle de bain. Chauffage individuel, double vitrage et pas de charges. PEB F Info et visites Alessandro Meschi 0496202263', 'no charges', NULL, NULL),
(21, 196, 'eng', 'Brabançonne', 'Brussels EU - In a 70\'s building year 70, semi-furnished apartment with 2 bedrooms in super good condition It consists of: entrance hall, living room with small terrace, separate kitchen, 2 bedrooms, toilet, bathroom and laundry. Info and visits Alessandro Meschi 0496202263', 'charges 250', NULL, NULL),
(22, 196, 'fra', 'Brabançonne', 'Bruxelles EU – Dans un bâtiment année 70, appartement semi-meublé avec 2 chambres en super bon état Il se compose de : hall d’entrée, living avec petite terrasse, cuisine séparée, 2 chambres, WC, sdb et buanderie. Infos et visites Alessandro Meschi 0496202263', 'charges 250', NULL, NULL),
(23, 197, 'eng', 'Titien', 'Brussels EU - Charming little furnished apartment on the ground floor. It consists of: living room, kitchen, sleeping area, bathroom, private garden and washing machine. Charges 180 € all inclusive (TV and internet) Info and tours Alessandro Meschi 0496202263', 'charges all inc 180', NULL, NULL),
(24, 197, 'fra', 'Titien', 'Bruxelles EU - Charmant petit appartement meublé au rez-de-chaussée. Il se compose de: salon, cuisine équipée, coin nuit, salle de bains, jardin privatif et machine à laver. Charges 180€ all inclusive (Tv and internet) Infos et visites Alessandro Meschi 0496202263', 'charges all inc 180', NULL, NULL),
(25, 201, 'eng', 'Furnished ULB', 'Perfectly furnished 2 bedroom flat. Very comfortable and newly renovated. Entrance hall, bright living-dining room, balcony, Large bedroom with en-suite bathroom, 2nd smaller bedroom and 2nd bathroom, Fully fitted eat-in kitchen with 2nd balcony. Laundry room. Parking garage included. Excellent location, calm and charming neighbourhood, walking distance to ULB, public transport, shops, restos and parcs. Charges of 200€. PEB E-. For info and visits call +32485271082', 'Parking included', 'great location', '2 balconies'),
(26, 201, 'fra', 'MEUBLE ULB', 'Appartement de 2 chambres parfaitement meublé. Très confortable et récemment rénové. Hall d\'entrée, salon / salle à manger lumineux, balcon, grande chambre avec salle de bain en suite, 2ème chambre et 2ème salle de bain, cuisine entièrement équipée avec balcon. Buanderie. Box Parking inclus. Excellent emplacement, quartier calme et charmant, à distance de marche de l\'ULB, des transports en commun, des magasins, des restos et des parcs. Charges de 200 €. PEB E-. Pour info et visites +32485271082', NULL, NULL, NULL),
(27, 203, 'eng', 'Noble', 'In this lovely Art DECO building, on the 4th floor, is a stunningly beautiful, appartment, fully furnished with top of the line, designer furniture and fittings. A security door opens into a bright, elegant hallway. There is a large, eat-in kitchen, with everything you need. There is a dining room with a decorative fire place and a marble dining table, a living room with flat screen TV, a den or study or library with built-in book shelves leads out to a charming balcony with a great view of the EU area. There are 2 bathrooms, one with a shower and the other with a bath tub, both are impeccable, modern and very clean. 2 spacious bedrooms, one with it\'s own en-suite bathroom both with built-in closets. The flat also has a seperate room (15m²) that was originally the servants quarters, this is the storrage space and laundry room equipped with washer and dryer. There is also a basement area ideal for wine! Optional parking garage is also available for 150eurs/month. PEB to follow. For info and visits call +32 458 271 082', 'Highest quality furnishings', 'fantastic location', 'Garage rental possible (150€/mo)'),
(28, 203, 'fra', 'Noble', 'Dans ce bel immeuble Art Deco, au 4ème étage, se trouve un appartement d\'une beauté incroyable, entièrement meublé avec des meubles et finitions haut de gamme. Une porte de sécurité s\'ouvre sur un couloir lumineux et élégant. Il y a une grande cuisine, avec tout ce dont vous avez besoin. Il y a une salle à manger avec une cheminée décorative et une table à manger en marbre, un salon avec télévision à écran plat, un bureau ou une bibliothèque avec étagères intégrées qui mène à un charmant balcon avec une vue magnifique sur la zone de l\'UE. Il y a 2 salles de bains, une avec une douche et l\'autre avec une baignoire, les deux sont impeccables, modernes et très propres. 2 chambres à coucher spacieuses, une avec sa propre salle de bains et les deux avec des placards intégrés et dressing. \nL\'appartement dispose également d\'une séparée (15m²) qui était à l\'origine le chambre de bonne c\'est l\'espace de rangement et la buanderie équipée d\'une laveuse et sécheuse. Il y a aussi une cave idéal pour le vin! Un parking en option est également disponible pour 150eurs / mois. PEB à suivre. Pour info et visites appelez le +32 458 271 082', NULL, NULL, NULL),
(29, 204, 'eng', 'LOFT', 'Officially in Schaerbeek but only a stones throw from WSP - This loft is a treasure! The Interior was designed by an architect and every detail is perfect! Enter into a huge living dining room with a fantastic open fireplace.\nWalk out to a private city garden terrace. The kitchen is open, fully fitted with all modern touches - a chefs dream! There are 2 large bed rooms and 2 baths , a laundry room, and guest WC.The closets are built in and very spacious. There is a garage and storage space. The property is ideally situated between NATO and the EU area, very close to the Diamant metro, shops, restos and parcs.\nPEB D. Charges are 250€/mo including water, electricity, common charges.\nFor info and visits call 0485271082', 'Great location', 'City garden', 'bright huge space'),
(30, 204, 'fra', 'LOFT', 'A Schaerbeek a cote de WSL - ce loft est un trésor! L\'intérieur a été conçu par un architecte et chaque détail est parfait! Entrez dans une immense salon / salle à manger avec un fantastique feu ouvert. Terrasse /  jardin privé. La cuisine est ouverte, équipée de toutes les touches modernes - un rêve! Il y a 2 grandes chambres à coucher et 2 salles de bains, une buanderie. Les placards sont intégrés et très spacieux. Il y a un garage et une cave. Le bien est idéalement située entre l\'OTAN et la zone européenne, tout près du métro Diamant, des magasins, des restos et des parcs.\nPEB D. Charges de 250 € / mois, y compris l’eau, l’électricité, les charges communes. Pour info et visites tel:  0485271082', NULL, NULL, NULL),
(31, 205, 'eng', '3 Bd Evere', 'Evere - Sublime penthouse fully furnished on the third floor with elevator of a small building with superb terrace of 25m ². It offers an entrance hall, a spacious living room, a beautiful fully equipped kitchen. 3 bedrooms, a bathroom, a shower room, a separate toilet, a laundry, a cellar, indoor parking. Air conditioning, double glazing with ventilation system and security door. Info and visits Alessandro Meschi 0496 20 22 63', NULL, NULL, NULL),
(32, 205, 'fra', '3 ch Evere', 'Evere - Sublime penthouse complètement meublé au troisième étage avec ascenseur d’une petite copropriété avec superbe terrasse de 25m². Il offre un hall d\'entrée, un salon spacieux, une magnifique cuisine hyper équipée. 3 chambres, une salle de bain, une salle de douche, une toilette séparée, une buanderie, une cave, un parking intérieur. Air conditionné, double vitrage avec système d’aération et porte blindée. Info et visites Alessandro Meschi 0496 20 22 63', NULL, NULL, NULL),
(33, 206, 'eng', 'Archimede', 'European District - Studio of +/- 40m², fully furnished, 5th floor, entrance hall wit kitchen, living room, sleeping area, wc, bathroom with washing machine. Charges 125 € for electricity, heating, water and common. PEB F. Info and visits Alessandro Meschi 0496202263', 'Charges 125 all inc exept internet', NULL, NULL),
(34, 206, 'fra', 'Archimede', 'Quartier Européenne –  Studio de +/- 40m², complètement meublé, 5ème étage,  Salon/living, coin à dormir, wc, salle de bain avec machine à laver et cuisine. Charges 125€ pour électricité, chauffage, eau et communs. Peu F. Info et visites Alessandro Meschi 0496202263', 'Charges 125 all inc exept internet', NULL, NULL),
(35, 207, 'eng', 'Duplex center', 'Brussels center - close to the Grande Place, completely renovated duplex on the top floor of a building of character It consists of: 2 bedrooms, office, toilet, bathroom and SDD on the 1st level. Large living loft style on the 2nd level with open kitchen and fireplace. Sale under VAT. PEB C 135 kWhEP / m² / year. Info and visits Alessandro Meschi 0496 20 22 63', NULL, NULL, NULL),
(36, 207, 'fra', 'Duplex center', 'Bruxelles centre – à deux pas de la Grande Place, duplex complètement rénové au dernier étage d\'une immeuble de caractère  Il se compose de: 2 chambres, bureau, WC, SDB et SDD au 1er niveau. Grand living style loft au 2eme niveau avec cuisine ouverte et feu ouvert. Vente sous régime TVA.  PEB C 135 kWhEP/m²/an. Info et visites Alessandro Meschi 0496 20 22 63', NULL, NULL, NULL),
(37, 209, 'eng', 'Schuman', 'Splendid apartment in a very elegant building with view over Cinquantenaire Park. Very bright and spacious. Large entrance hall, superb living/dining rooms, 3 large bed rooms, fully fitted modern kitchen, parquet floors throughout, double glazed windows, bathroom, shower room, washing machine, all fully renovated to perfection. Parking spot included plus a basement stprage room. PEB C! In an ideal location near the Schuman Metro, shops, restaurants... For info and visits call 0485 27 10 82', 'Fab location', 'Elegant building', 'spacious and bright'),
(38, 209, 'fra', 'Schuman', 'Splendide appartement dans un immeuble très élégant avec vue sur le parc du Cinquantenaire. Très lumineux et spacieux. Grand hall d\'entrée, superbes salon / salles à manger, 3 grandes chambres à coucher, cuisine moderne entièrement équipée, parquet, double vitrage, salle de bains, salle de douche, machine à laver, le tout entièrement rénové à la perfection. Place de parking incluse plus une cave. PEB C! Idéalement situé à proximité du métro Schuman, des magasins, des restaurants ... Pour plus d\'informations et visites visitez le 0485 27 10 82', NULL, NULL, NULL),
(39, 210, 'eng', 'chatelain', 'Superb furnished apartment with terrace, in the Châtelain district. Large living / dining room with balconies, fully equipped modern kitchen that opens onto a beautiful terrace. Upstairs 2 bright bedrooms, 1 full bathroom with shower and bath, in the top floor a 3rd bedroom with shower and sink ensuite. Laundry and guest WC. Perfectly renovated and furnished with taste and elegance. Phone and internet included. Close to shops, restaurants and public transport. PEB E.For info and visits tel: +32485271082', 'super location', 'great terrace', 'lovley furniture'),
(40, 210, 'fra', 'chatelain', 'Superbe appartement meublé avec terrasse, dans le quartier Châtelain. Grand salon / salle à manger avec balcons, cuisine moderne entièrement équipée qui donne sur une belle terrasse. A l\'étage 2 chambres lumineuses, 1 salle de bain complète avec douche et baignoire, dans le grenier rénové 3e chambre avec salle de douche et lavabo. Buanderie et WC invités. Parfaitement rénové et meublé avec goût et élégance. Tél et internet inclus. Proche des commerces, restaurants et transports publics. PEB E.Pour info et visites tel: +3248527108', NULL, NULL, NULL),
(41, 211, 'eng', 'maison de maitre', 'On the main floor of a \"Maison de Maitre\", fully renovated with taste and charm: Enterance hall leades into a large living room, a dining room with access to the garden/terrace and an open plan, fully fitted kitchen. Downstairs is seperate WC, a beautiful large shower with double sinks, 2 big bedrooms, lots of natural light and built in closets. This flat is ideally located in the most elegant part of IXELLES, near Chatelain, on a quiet street close to shops, parcs and public transport. The flat has hard wood floors, tiles and double glazed windows. PEB C. For info and visits call 0485 271 082', 'excellent location', 'lovley space', 'beautiful courtyard/garden'),
(42, 211, 'fra', 'maison de maitre', 'Au rez-de-chaussée d\'une maison de maître, entièrement rénovée avec goût et charme. Le hall d’entrée mène à un grand salon, une salle à manger avec accès au jardin / terrasse et une cuisine américaine entièrement équipée. En bas se trouve un WC séparé, une belle grande douche avec double évier, 2 grandes chambres à coucher, beaucoup de lumière naturelle et placards encastrés. Cet appartement est idéalement situé dans le quartier le plus élégant d’IXELLES, près du Châtelain, dans une rue calme à proximité des commerces, des parcs et des transports en commun. L\'appartement dispose de plancher en parquet et de fenêtres à double vitrage. PEB C. Pour informations et visites, appelez le 0485 27 10 82', NULL, NULL, NULL),
(43, 213, 'eng', 'ULB Luxury FURNISHED', 'Perfectly furnished 2 bedroom flat. Very comfortable and newly renovated. Entrance hall, bright living-dining room, balcony, Large bedroom with en-suite bathroom, 2nd smaller bedroom and 2nd bathroom, Fully fitted eat-in kitchen with 2nd balcony. Laundry room. Parking garage included. Excellent location, calm and charming neighbourhood, walking distance to ULB, public transport, shops, restos and parcs. Charges of 200€. PEB E-. For info and visits call +32485271082', 'great location', 'beautiful furniture', 'garage and terrace'),
(44, 213, 'fra', 'ULB Meublé LUXE', 'Appartement de 2 chambres parfaitement meublé. Très confortable et récemment rénové. Hall d\'entrée, salon / salle à manger lumineux, balcon, grande chambre avec salle de bain en suite, 2ème chambre et 2ème salle de bain, cuisine entièrement équipée avec balcon. Buanderie. Box Parking inclus. Excellent emplacement, quartier calme et charmant, à distance de marche de l\'ULB, des transports en commun, des magasins, des restos et des parcs. Charges de 200 €. PEB E-. Pour info et visites +32485271082', NULL, NULL, NULL),
(45, 214, 'eng', 'Archimede', 'European District - Large 2 bedroom apartment on the 1st floor unfurnished. It consists of: large living room with open kitchen, 2 bedrooms, 2 bathrooms and huge terrace. Charges 240 € for electricity, heating, water and common. Colocation possible.\nInfo and visits Alessandro Meschi 0496202263', 'Charges 240 all in', NULL, NULL),
(46, 214, 'fra', 'Archimede', 'Quartier Européenne –  Grand appartement 2 ch au 1er étage non meublé. Il se compose de : grand séjour avec cuisine ouverte, 2 chambres, 2 salles de bain et énorme terrasse. Charges 240€ pour électricité, chauffage, eau et communs. Colocation possibles.\nInfo et visites Alessandro Meschi 0496202263', 'Charges 240 all in', NULL, NULL),
(47, 218, 'eng', 'Stevin rent', 'Brussels Eu - In the heart of the EU district, superb studio in perfect condition of +/- 46m². On the 2nd floor of a beautiful house, it consists of: large living room with fully equipped open kitchen,  and shower room. Low charges, all individual meters and electricity conform. Info and visits Alessandro Meschi 0496 20 22 63.', 'Charges 50', NULL, NULL),
(48, 218, 'fra', 'Stevin loc', 'Bruxelles Eu – Au cœur du quartier EU, superbe studio en parfait état de +/- 46m². Au 2eme étage d\'une belle maison, il se compose de: grand living avec cuisine ouverte super équipée et salle de douche. Charges faibles, tous compteurs individuels et électricité conforme. PEB D. Info et visites Alessandro Meschi 0496 20 22 63.', 'Charges 50', NULL, NULL),
(49, 220, 'eng', 'Exceptional', 'Beaux-Arts style house from 1912, (Architect Jos EVRARD) unique in its beauty, charm and historical value. \nPerfect marble entrance leads to an elegant lobby with a majestic staircase. Living and dining room of 65m² with original fireplaces, tapestries, stained glass windows, and\nglass doors that lead to the enchanted courtyard of 50m². Downstairs, a large kitchen (to be updated), a guest room/office, a laundry room, a WC and many cellars. \nOn the 1st and 2nd floors: 4 huge bedrooms, 2 large bathrooms, balconies ... In excellent condition, ideally located close to shops, restaurants, parks and public transport. PEB E +', 'historical value', 'light', NULL),
(50, 220, 'fra', 'Exceptionnel', 'Maison de style Beaux-Arts de 1912 (architecte Jos EVRARD) unique par sa beauté, son charme et sa valeur historique.\nL\'entrée en marbre parfaite mène à un hall élégant avec un escalier majestueux. Salon et salle à manger de 65m² avec cheminées, tapisseries, vitraux et\nportes vitrées qui mènent à la cour enchantée de 50m². En bas, une grande cuisine (à rafraîchir), une chambre d’amis / bureau, une buanderie, un WC et de nombreuses caves.\nAu 1er et 2ème étages: 4 grandes chambres, 2 grandes salles de bain, balcons ... En excellent état, idéalement situé à proximité des commerces, des restaurants, des parcs et des transports en commun. PEB E +', 'charm', 'location', NULL),
(51, 229, 'eng', 'Penthouse, 3bdr with terrace and parking!', 'Modern, elegant and bright: this spacious duplex has an open living and dining room, a 15m² terrace, a fully fitted kitchen, guest WC, closet and laundry room. There are 3 bedrooms, one with an en-suite bath room and the other 2 bedrooms are upstairs sharing the second bathroom. There is an open space mezzanine, ideal for an office, a basement storage area and a parking spot for 100€/mo. All in excellent condition with hardwood floors, double glazed windows, ideally situated near shops, restaurants, public transport NATO, and walking distance to the \"Geneve\" commission buildings. PEB is D-.', 'Excellent condition', 'Bright and spacious', NULL),
(52, 229, 'fra', 'Penthouse, 3ch avec terrasse et parking!', 'Moderne, élégant et lumineux: ce spacieux duplex dispose d\'un salon / salle à manger ouvert, d\'une terrasse de 15 m², d\'une cuisine entièrement équipée, un WC invités et une buanderie. Il y a 3 chambres à coucher, une avec une salle de bain attenante, les 2 autres chambres sont à l\'étage avec la 2e salle de bain. Il y a une mezzanine, idéale pour un bureau, une cave et une place de parking pour 100 € / mois. Le tout en excellent état avec parquet, fenêtres double vitrage. Idéalement situé à proximité de magasins, restaurants, transports en commun et de l\'OTAN. PEB D-.Pour info et visites appeler Sonja +0032 485 271 082 (EN, FR, DE, IT)', NULL, NULL, NULL),
(53, 230, 'eng', 'FURNISHED - 3bdr with terrace', 'In the very heart of Brussels, a stone\'s throw from the Opera and the Grand Place, bright, spacious, split-level loft. Enter through a common courtyard, elevator to the third floor, the flat opens onto a large, living and dining room with an open fire place and fully fitted modern kitchen. There are 2 bed rooms on this level, 2 bath rooms (one with shower one with tub), lots of storage space, and a laundry area. Upstairs to the 3rd bedroom/office/fitness space, with skylights and access to the lovely private terrace. The appartment itself is surprisingly calm, quiet and very secluded, while surrounded by all the high street shops, restaurants, bars, metro DeBrouckere and everything Brussels has to offer. PEB E. For information and visits please call +0032 485 271 082\n250 € of charges include common charges, heat, water, and electricity!', 'Beautifully decorated', 'Great location', 'space and light!'),
(54, 230, 'fra', 'Meublé - Loft 3 ch avec terrasse!', 'Au coeur de Bxl - Duplex lumineux, spacieux et calme. Entrée par une cour commune, au 3e étage, avec ascenseur, l\'appartement s\'ouvre sur un grand salon et salle à manger avec feu ouvert et cuisine moderne équipée. 2 chambres, 2 salles de bain, amples espaces de rangement et buanderie. A l\'étage 3ème chambre /bureau , avec puits de lumière et accès à la belle terrasse privée. L\'appartement et très calme et isolé, tout en étant dans un quartier vibrant, proche de magasins, restos, bars et du métro De Brouckère... PEB E charges 250€ par mois inclusives de chauffage, eau et électricité. Pour info et visites appeler +0032 485 271 082 (EN, FR, DE, IT)', NULL, NULL, NULL),
(55, 231, 'fra', 'LOFT - 3 chambres avec parking, piscine et fitness!', 'Limite BXL 1000, à côté de l\'emblématique Basilique de Koekelberg ce loft génial était autrefois une chocolaterie. Il est lumineux et spacieux avec un grand salon ouvert, une salle à manger et une cuisine entièrement équipée, de nombreux puits de lumière, plusieurs terrasses, un WC visiteurs, 3 chambres à coucher, une salle de bains avec douche et une avec baignoire, ainsi qu\'un magnifique espace mezzanine idéal pour une bureau ou chambre d\'amis. Il y a des planchers en bois et des fenêtres à double vitrage, une zone de stockage au sous-sol et un emplacement de parking. La propriété a également accès à une piscine intérieure et à une salle de sport. Confortablement situé près de la station de métro Simonis, à proximité de l’école européenne', NULL, NULL, NULL),
(56, 231, 'eng', 'FAB loft – 3bdrs with parking, pool and fitness!', 'In 1081 - KOEKELBERG, next to 1000 Bxl and the iconic Basilique, this awesome loft was formerly a chocolate factory. It’s bright and spacious with a large, open plan living, dining room and fully fitted kitchen, lots of skylights, several terraces, a guest WC, 3 bedrooms, a bathroom with shower and one with a bathtub, and wonderful mezzanine space ideal for an office or guest room. There are hard wood floors and double-glazed windows, a basement storage area and a parking spot. The property also has access to an indoor pool and fitness area. Ideally situated at the Simonis Metro stop, close to the EEB4, shops and restaurants.  PEB E', 'large and bright', 'super cool', NULL),
(57, 232, 'eng', 'RENT EU 2 bd', 'Brussels EU - In the heart of the EU district super sunny apartment with 2 bedroomsin a building of the year 70, first occupation after renovation. On the 4th floor +/- 80m², it consists of: entrance hall, living room with nice view on the park, open kitchen on the living room, master bedroom with wardrobes, 2nd bedroom, separate toilet and shower room. Cellar. The apartment has just been redone. PEB C-. Info and visits Alessandro Meschi 0496 20 22 63', 'Charges 155', NULL, NULL),
(58, 232, 'fra', 'LOC EU 2ch', 'Bruxelles EU – Au cœur du quartier EU appartement 2ch super ensoleillé dans un bâtiment des année 70, première occupation après rénovation. Au 4eme étage +/- 80m², il se compose de: hall d\'entrée, séjour avec jolie vu sur le parc, cuisine ouverte sur le séjour, chambre principale avec placards, 2eme chambre, WC séparé et sdd. Cave. L\'appartement vient d’être complément rénové. PEB C-. Info et visites Alessandro Meschi 0496 20 22 63', 'Charges 155', NULL, NULL),
(59, 233, 'eng', 'Defacqz', 'Ixelles - Defacqz - Close to Av Louise and Place du Châtelain, 1 bedroom apartment on the 1st floor in a building of 20 units. It consists of: entrance hall with cloakroom, wc with washing machine, living room with fully equipped open kitchen, bathroom and bedroom. Cellar in the basement. Double glazing and electricity compliant. Possibility to buy furnished. PEB C+. Info and visits Alessandro Meschi 0496 20 22 63', 'Charges 130', NULL, NULL),
(60, 233, 'fra', 'Defacqz', 'Ixelles – Defacqz – A deux pas de la Av Louise et de la Place du Châtelain, appartement 1 chambre au 1er étage dans un bâtiment de 20 unités. Il se compose de:  hall d\'entrée avec vestiaire, wc avec emplacement machine à laver, living avec cuisine ouverte super équipée, salle de bain et chambre. Cave au ssol.  Double vitrage et électricité conforme. Possibilité achat meublé. PEB C+. Info et visite Alessandro Meschi 0496 20 22 63', 'Charges 130', NULL, NULL),
(61, 235, 'eng', 'Rome ITALY', 'Charming home in the Roman countryside only 20 mins north of the city. 110M² villa built in 2005. 600m² garden with olive trees, and lots of privacy. Open space main floor with built in fitted kitchen, living and dining room, laundry, storage... Upstairs to 2 bdrs and a 2nd full bathroom. Parquet floors and terracotta tiles, air conditioning, efficient gas heating ... Great location near all the shops. Ideal as a retirement home, vacation home or as an investment...PEB underway', 'Peaceful', 'Bright', 'great locatio and all you need!'),
(62, 236, 'eng', 'Tubize', 'Tubize - In a quiet street, 200mt from the train station, large apartment of +/- 93m² with 2 bedrooms on the 1st floor in a small co-owenrship.\nIt consists of: entrance with cupboard, large living room with open fully equipped kitchen (45m²), night hall, first bedroom (18m²), second bedroom (13m²) and large shower room (renovated in 2019). Cellar and two parking spots included in the price. The apartment was fully renovated in 2013 and the bathroom in 2019. PEB B kWh / m² / year 144. Info and visits Alessandro Meschi 0496202263', 'Charges 70', '2 parkings', NULL),
(63, 236, 'fra', 'Tubize', 'Tubize – Dans une rue calme, à 200mt de la gare, spacieux appartement de +/- 93m² avec 2 chambres au 1er étage dans une petite copropriété.\nIl se compose de: entrée avec placard, grand séjour avec cuisine ouverte full équipée (45m²), halle de nuit, première chambre (18m²), deuxième chambre (13m²) et grande salle de douche (rénovée en 2019). Cave et deux emplacements parking compris dans le prix. L\'appartement a été rénove en profondeur en 2013 et la salle de douche en 2019. Chauffage individuel avec chaudière à condensation. PEB B kWh/m²/an 144.  Info et visites Alessandro Meschi 0496202263', 'Charges 70', '2 parkings', NULL),
(64, 238, 'eng', 'Stéphanie', 'Ixelles - On Place Stéphanie, with a beautiful view, in a magnificent building from the 1930s, beautiful apartment of +/- 223 m² located on the 1st floor. It consists of: large living room, fully equipped kitchen, 2 bedrooms and an office, 2 bathrooms and 2 cellars. Electricity on conformity, recent renovation. PEB E-. Info and visits Alessandro Meschi 0496 20 22 63', 'Charges 250', NULL, NULL),
(65, 238, 'fra', 'Stéphanie', 'Ixelles - Sur la Place Stéphanie,avec belle vue, dans un magnifique immeuble des années 30 , bel appartement de +/- 223 m² situé au 1er étage. Il se compose de: grand salon, cuisine super équipée, 2 chambres et un bureau, 2 salles de bains et 2 caves. Électricité conforme, rénovation récente. PEB E-. Info et visites Alessandro Meschi 0496 20 22 63', 'Charges 250', NULL, NULL),
(66, 239, 'eng', 'Place Brugmann', 'Fully renovated, bright and very tastefully done, on the 3rd and 4th floor of a charming \"maison de maitre\" from 1912. Over 130m² the property includes: entrance area, living/dining room, fully fitted modern kitchen that opens onto an enormous terrasse, large bedroom, a full bathroom with shower and bathtub, and a built in dressing area. Upstairs to the spacious master bedroom with an en-suite bathroom with shower. Beautifully finished hard wood floors, lovely tiles, marble and double glazed windows. Individual gas heating, 2 basement storage rooms, no elevator. In a wonderful location close to shops, restaurants and public transport. PEB G. Common charges of +/- 55€/month. For info and visits call +32 485 271 082', 'Bright', 'super location', 'fab terrace!!'),
(67, 239, 'fra', 'Place Brugmann', 'Penthouse, entièrement rénové, lumineux et aménagé avec beaucoup de goût, au 3e et 4e étage d\'une charmante maison de maître de 1912, sans ascenseur. Sur 130 m² la propriété comprend: entrée, séjour / salle à manger, cuisine moderne entièrement équipée ouvrant sur une immense terrasse. Une grande chambre à coucher, une salle de bain avec douche et baignoire, et un dressing intégré. A l\'étage, la spacieuse chambre principale avec une salle de douche et wc. Parquet magnifique, beau carrelages, marbre, et fenêtres à double vitrage. Chauffage individuel au gaz, 2 caves en sous-sol. Dans un endroit merveilleux à proximité des commerces, restaurants et transports en commun. PEB G. Charges communes de +/- 55 € / mois. Pour informations et visites Sonja +32 485 271 082', NULL, NULL, NULL),
(68, 240, 'eng', 'Spacious and Bright 2 bedroom with parking garage', 'Bright, spacious and completely renovated Entrance hall leads into a living / dining room with a magnificent open kitchen. 2 bedrooms, bathroom, separate wc, washer, dryer and built-in cupboards. Double glazing, solid wood flooring, terrace, cellar and garage box. Charges 200 €: heating, water, common electricity and common charges ... Ideal rental with shops, parks and restaurants on your doorstep, as well as the Tomberg metro and the Poseidon swimming pool ... The PEB C -', 'great location', 'box garage', 'lovley renovation'),
(69, 240, 'fra', '2 Chambres plus box parking', 'Lumineuse, spacieuse et complètement rénové  Hall d\'entrée donne sur un salon / salle  à manger avec une magnifique cuisine ouverte. 2 chambres, salle de bains, wc séparé, laveuse, sécheuse et placards intégrés. Double vitrage, planché en bois massif, terrasse, cave et box garage. Charges 200 € : chauffage, l’eau, l’électricité commune et les charges communs... Location idéal avec des magasins, parcs et des restaurants à votre porte, ainsi que le métro Tomberg et la piscine Poséidon ... Le PEB C-', NULL, NULL, NULL),
(70, 241, 'eng', 'EU - Superb Triplex', 'Brussels EU - In the heart of the European district, 50 mt from the Cinquantenaire park, in an elegant Hotel de Maitre (10mt facade), superb triplex with large garden (100m2), terrace (30m2) and garage. It consists on the ground floor of: entrance hall, three rooms in a row with access to the garden, separate kitchen with dining room with also access to the garden, guest toilet, garage and large super well-maintained garden of +/- 100 m2 with fountain and lighting. On the 1st floor: Master bedroom with private dressing and en-suite bathroom,  a large second bedroom which leads to the terrace of +/- 30m2,  a second bathroom and a third bedroom (currently used as an office)  also with access to the terrace. The half-basement consists of: guest bedroom, shower room, large laundry room with boiler, 2 cellars. Double glazing everywhere, excellent general condition. Property very difficult to find !!! PEB F. Info and visits Alessandro Meschi 0496 20 22 63', NULL, NULL, NULL),
(71, 241, 'fra', 'EU - Superb Triplex', 'Bruxelles EU – Au plein coeur du quartier européen, à 50 mt du parc du Cinquantenaire, dans un élégant hôtel de maître (façade 10mt), superbe triplex avec grand jardin (100m2), terrasse (30m2) et garage. Il se compose au RDC de: hall d\'entrée, trois pièces en enfilade avec  accès au jardin, cuisine séparée avec salle à manger avec aussi accès au jardin, wc invité, garage et grande jardin super bien entretenu de +/- 100 m2 avec fontaine et illumination. Au 1er étage on trouve: la chambre principale avec dressing et salle de bain en suite, la deuxième grande chambre qui mène à la terrasse de +/- 30m2, une salle de bain privé et la troisième chambre qui mène aussi à la terrasse (actuellement utilisée comme bureau). Le mi-sol se compose de: chambre invitées, salle de douche, grande buanderie avec local chaudière, 2 caves. Double vitrage partout, excellent état général. Bien très difficile à trouver !!! PEB F. Info et visites Alessandro Meschi 0496 20 22 63', NULL, NULL, NULL),
(72, 242, 'eng', '2 bd EU', 'Brussels EU - In a 1970s building, apartment with 2 bedrooms in super good condition It consists of: entrance hall, living room with small terrace, separate kitchen, 2 bedrooms, WC, bathroom and laundry room. Possibility to buy furnished. Large optional closed box (35.000 €) PEB F. Info and visits Alessandro Meschi 0496202263', 'Charges 220', NULL, NULL),
(73, 242, 'fra', '2 ch EU', 'Bruxelles EU – Dans un bâtiment année 70, appartement avec 2 chambres en super bon état Il se compose de : hall d’entrée, living avec petite terrasse, cuisine séparée, 2 chambres, WC, sdb et buanderie. Possibilité achat meublé. Grand box fermé en option (35.000 €) PEB F. Infos et visites Alessandro Meschi 0496202263', 'Charges 220', NULL, NULL),
(74, 243, 'eng', 'St Chaterine Duplex', 'Brussels center - Next to Place St Catherine, in the historic center of Brussels, on the top floor of a character building, magnificent one bedroom duplex with attic converted into 4 bedrooms, this means a total of 5 bedrooms, 1SDB and 1SDD. The apartment was renovated in 2017, offering an area of 200m2 including 165m2 of living space. On the 1st level: large living room with 4 balconies, fully equipped kitchen, bedroom of 20m2 with dressing area, bathroom, guest WC. On the 2nd level: attics currently converted into 4 bedrooms, a shower room with laundry area and 1 WC. Under the roof, a storage attic of 16m2. PEB G. Info and visits Alessandro Meschi 0496 20 22 63', NULL, NULL, NULL),
(75, 243, 'fra', 'St Chaterine Duplex', 'Bruxelles centre - A coté de la Place St Catherine, dans le centre historique de Bruxelles, au dernière étage d’un immeuble de caractère, magnifique duplex d\'une chambre avec Grenier aménagé en 4 chambres, cette a dire un total de 5 chambres, 1SDB et 1SDD. L\'appartement a été énové en 2017,  offrant une superficie de 200m2 dont 165m2 habitables. Au 1er niveau : grand living avec 4 balcons, cuisine full équipée, chambre de 20m2 avec espace dressing, salle de bain, WC invité. Au 2ème niveau : greniers actuellement aménagés en 4 chambres, une salle de douche avec espace buanderie et 1 WC. Sous le toit, un grenier de rangement de 16m2.PEB G. Info et visites Alessandro Meschi 0496 20 22 63', NULL, NULL, NULL),
(76, 244, 'eng', 'Meiser', 'Schaerbeek - Place Meiser, in a building from the 70s, on the 1st floor apartment of +/- 90m2. It consists of: entrance hall, living room, separate kitchen with small bacon, two bedrooms, one with another small balcony, separate wc and bathroom. Provide renovation work. PEB F. Info and visits Alessandro Meschi 0496 20 22 63', 'Charges 190', 'To be renovated', NULL),
(77, 244, 'fra', 'Meiser', 'Schaerbeek – Place Meiser, dans un bâtiment des années 70, au 1er étage appartement de +/- 90m2. Il se compose de: hall d’entrée, living, cuisine séparée avec petit bacon, deux chambres dont une avec un autre petit balcon, wc séparé et salle de bain. Prévoir travaux de rénovation. PEB F. Info et visites Alessandro Meschi 0496 20 22 63', 'Charges 190', 'Prevoir Rénovation', NULL),
(78, 245, 'eng', 'Chant d\'oiseau', 'Next to Woluwe Park, on one of the most beautiful quiet residential streets in Chant d’Oiseau near Av de Tervuren and Montgomery.\nEntrance hall with WC, stairs to bright living room with office and built-in shelves. Fully equipped kitchen with adjoining dining room. 2 bedrooms and extra office or baby room upstairs. Master bedroom has an en-suite Shower, WC and separate dressing room. 2nd full bathroom for the other 2 rooms. Hard wood floors, washer and dryer, double glazed windows, security door, video intercom, central heating, and attic storage. Safe and quiet area, close to public transport, shops, parcs and weekly evening market in the square, PEB F. Provision of charges 150€/mo', 'great location', 'Bright', 'spacious'),
(79, 245, 'fra', 'Chant d\'oiseau', '140m² : Hall d\'entrée +WC, séjour lumineux avec bureau et étagères intégrées. Cuisine entièrement équipée avec salle à manger attenante.3 chambres à l\'étage: 2 salle de bains, dressing, machine à laver et sechoir, planchers en bois, fenêtres à double vitrage, porte blindée, vidéophone, chauffage central et grenier avec grands espaces de rangements… PEB F.\nProvision charges €150/mo', NULL, NULL, NULL),
(80, 247, 'eng', 'Passive Furnished Fab', 'Perfection! Furnished Passive 1 bdr flat\nFully Furnished flat of 68m² where every detail is beautifully renovated with modern style and luxury. Bright living room, fully fitted kitchen, 1 bedroom, elegant shower and bath, separate WC, washer/dryer and balcony. Ideally located on a lovely street, safe and quiet while close to public transport, shops, restaurants - Place Brugmann and Châtelain. PEB (Pre Passive renovations!) G', 'Passive !', 'Furnished in Style', 'Top Location'),
(81, 247, 'fra', 'Passive Furnished Fab', 'La perfection ! Appartement meublé passif de 1 ch. \nEntièrement meublé de 68 m² où chaque détail est magnifiquement rénové avec style moderne et luxe. Séjour lumineux, cuisine entièrement équipée, 1 chambre, douche et baignoire élégantes, WC séparés, laveuse / sécheuse et balcon. Idéalement situé sur une jolie rue, sûre et calme tout en étant proche des transports en commun, commerces, restaurants - Place Brugmann et Châtelain. PEB (Rénovations Pré Passives!) G', NULL, NULL, NULL),
(82, 248, 'eng', '\"1030\" hip and trendy Schaerbeek', 'Beautiful 2 or 3 bdr flat\nIn the trendy and safe part of Schaerbeek, at park Josephat - lovely, bright 2 or 3 bedroom flat with fully fitted modern kitchen, 2 charming balconies, high ceilings, original wood floors and space for your bike! Great location close to public transport, shops and restaurants. Easy bike ride to Nato or the EU Schuman area. Above the neighborhood bar “1030” which is very respectful of the quiet residential area and their nice neighbours.', 'space', 'light', 'location'),
(83, 248, 'fra', '1030 trendy', 'Bel appartement de 2 ou 3 ch\nDans une zone branchée et sûre de Schaerbeek, près du parc Josaphat - bel appartement lumineux de 2 ou 3 chambres avec cuisine moderne entièrement équipée, 2 balcons charmants, de hauts plafonds, des planchers en bois d\'origine et de l\'espace pour votre vélo! Excellent emplacement à proximité des transports publics, des magasins et des restaurants. Déplacement à vélo facile vers l\'OTAN ou la zone Schuman de l\'UE. Au-dessus du bistrot de quartier \"1030\" très respectueux du quartier résidentiel calme et de ses bons voisins.', NULL, NULL, NULL),
(84, 249, 'eng', 'Furnished Penthouse with fab terrace', 'Fully renovated, bright and very tastefully done, on the 3rd and 4th floor of a charming \"maison de maitre\" from 1912. Over 130m² the property includes entrance area, living/dining room, fully fitted modern kitchen that opens onto an enormous terrasse, large bedroom, a full bathroom with shower and bathtub, and a built in dressing area. Upstairs to the spacious master bedroom with an en-suite bathroom with shower. Beautifully finished hard wood floors, lovely tiles, marble and double-glazed windows. Individual gas heating, 2 basement storage rooms, no elevator. In a wonderful location close to shops, restaurants and public transport. PEB G. Common charges of +/- 55€/month. For info and visits call +32 485 271 082', 'Excellent location', 'Beautifully furnished', 'Fantastic terrace'),
(85, 249, 'fra', 'Meublé - Penthouse with fab terrace', 'Penthouse meublé, entièrement rénové, lumineux et aménagé avec beaucoup de goût, au 3e et 4e étage d\'une charmante maison de maître de 1912, sans ascenseur. Sur 130 m² la propriété comprend : entrée, séjour / salle à manger, cuisine moderne entièrement équipée ouvrant sur une immense terrasse. Une grande chambre à coucher, une salle de bain avec douche et baignoire, et un dressing intégré. A l\'étage, la spacieuse chambre principale avec une salle de douche et wc. Parquet magnifique, beau carrelages, marbre, et fenêtres à double vitrage. Chauffage individuel au gaz, 2 caves en sous-sol. Dans un endroit merveilleux à proximité des commerces, restaurants et transports en commun. PEB G. Charges communes de +/- 55 € / mois. Pour informations et visites Sonja +32 485 271 082', NULL, NULL, NULL),
(86, 250, 'eng', 'CITY 2', 'HORECA business - In the CITY 2 mall. Commercial space of approximately 60m², located in the HORECA part of City 2. It consists of a counter in front of several tables available for customers. Very recent equipment and loyal customers BUSINESS TO BE GIVEN. Info and visits Alessandro Meschi 0496202263', 'Charges 1200', NULL, NULL),
(87, 250, 'fra', 'CITY 2', 'Commerce HORECA – Dans le centre CITY 2 surface commerciale d\'environ 60m², située dans la partie HORECA du City 2. Il se compose d\'une comptoir face à plusieurs tables disponibles pour les clients. Équipements très récents et clientèle fidélisée . FONDS DE COMMERCE A REMETTRE. Info et visites Alessandro Meschi 0496202263', 'Charges 1200', NULL, NULL);
INSERT INTO `property_translations_copy` (`id`, `property_id`, `locale`, `name`, `short_desc`, `key_feature_1`, `key_feature_2`, `key_feature_3`) VALUES
(88, 251, 'eng', 'Arlon', 'Bruxelles EU  - en Face au Concert Noble, appartement, non meublé, situé au 2ème étage +/- 140 m2:comprennent: hall d’entrée, grand séjour, cuisine super équipée, petite loggia à l’arrière, terrasse à l’avant, 3 grandes chambres – 1 salle, de bain, WC, PEB G. Dispobile du 1/10/2020. Colocation possibles Info et visites Alessandro Meschi 0496 20 22 63', 'Charges 250', NULL, NULL),
(89, 251, 'fra', 'Arlon', 'Brussels EU - Opposite to the Concert Noble, apartment, unfurnished, located on the 2nd floor +/- 140 m2: include: entrance hall, large living room, fully equipped kitchen, small loggia at the back, terrace at the front , 3 large bedrooms, 1 bathroom, bathroom, WC, PEB G. Colocation ok. Available from 1/10/2020. Info and visits Alessandro Meschi 0496 20 22 63', 'Charges 250', NULL, NULL),
(90, 252, 'eng', 'Michel Ange', 'Brussels EU area - Superb « Maison de maitre » close to Schumann and the Parc du Cinquantenaire in the beautiful Av Michel Ange. The house of 345 M2 is on 4 levels plus cellars, exterior courtyard plus small room ideal as home office or profession or gym. On the ground floor: entrance hall which leads to the separate fully equipped kitchen with dumb waiter directly to the dining room on the 1st floor, a guest WC and an office. Access to the outdoor courtyard via the kitchen. On the 1st floor, wonderful dining room and living room with decorative fireplace and built-in period furniture. 2nd floor: family room or bedroom, bathroom and a second bedroom. On the 3rd floor, master suite with large bedroom, bathroom and dressing room. Additionally, an attic, cellar, laundry room and boiler room. The house has been completely renovated and restored with taste and while respecting the original charm.\nInfo and visits Alessandro Meschi 0496202263', NULL, NULL, NULL),
(91, 252, 'fra', 'Michel Ange', 'Bruxelles Eu – Superbe Maison de maitre situé à deux pas de Schumann et du Parc du Cinquantenaire dans la merveilleuse Av Michel Ange. La maison de 345 M2 disposée sur  4 niveaux plus caves, cour extérieure et petit pièce espérée idéale pour profession libérale où petite gym privative. Elle se compose de: RDC, hall d’entrée qui amène  à la cuisine séparée super équipée avec monte-charge direct vers la salle à manger au 1er étage, WC  invités et bureau. Accès à la courte extérieure via la cuisine et pièces supplémentaire. Au 1er étage, merveilleuse salle à manger avec grande cheminée et meuble de l’époque et salon. Au 2eme étage: salle télé ou chambre, salle de bain et une deuxième chambre. Au 3eme et dernier étage, suite principale avec grande chambre à coucher, salle de bain privative et dressing. Grenier, cave, buanderie et local chaudière. La maison a été complètement rénovée et aménagée avec grand gout en respectent le charme d’origine. \nInfo et visites Alessandro Meschi 0496202263', NULL, NULL, NULL),
(92, 253, 'eng', 'Overijse Villa', 'Overijse - Jesus Eik - Superb villa on two floors plus basement of +/- 280m2, with large fenced garden (1000m2) and two garages. It consists on the ground floor: entrance hall, large living room, dining room, fitted kitchen, office and wc. On the 1 and floor 4 bedrooms, 3 bathrooms and WC., 2 garages, 2 cellars and boiler room. PEB 265kWh / year. Info and visits Alessandro Meschi 0496 20 22 63', NULL, NULL, NULL),
(93, 253, 'fra', 'Overijse Villa', 'Overijse – Jesus Eik – Superbe villa de caractère sur deux étages plus ssol de +/- 280m2,  avec grand jardin clôturé (1000m2) et deux garages. Elle se compose au RDC : hall d’entrée, grand séjour, salle à manger, cuisine équipée, bureau et wc. Au 1 et étage  4 chambres, 3 salles de bain et WC. Griener accessible, 2 garages, 2 caves et local chaudière. PEB 265kWh/an. Info et visites Alessandro Meschi 0496 20 22 63', NULL, NULL, NULL),
(94, 254, 'eng', 'SOLD !!! Franklin', 'SOLD !!! Bruxelles EU - Schuman – Classic Town house very brightful of +/- 293m² on 4 levels plus basement, garage and garden. It is made up on the ground floor entrance hall, 3 rooms in a row and fully equipped kitchen. On the mezzanine, WC and laundry room. 2 bedrooms and bathroom on the 1st floor with platform, 2 bedrooms (or master bedroom with dressing room) plus shower room and separate WC on the 2nd floor. On the 3rd floor: two bedrooms, one with mezzanine and bathroom. In the basement: access to the garden and terrace, workshop, wine cellar and 2 cellars. 1 car garage. PEB D. Info and visits Alessandro Meschi 0496 20 22 63', NULL, NULL, NULL),
(95, 254, 'fra', 'VENDU !!! Franklin', 'VENDU !!! Bruxelles EU – Schuman - Maison de maître de caractère et très lumineuse de +/- 293m² sur 4 niveaux plus ssol, garage et jardin. Elle se compose au RDC hall d\'entrée, 3 pièces en enfilade et cuisine super équipée. A l\'entresol WC et buanderie. 2 chambres et salle de bain au 1er étage avec plate-forme, 2 chambres (ou chambre parentale avec dressing) plus salle de douche (douche à l’italienne) et WC séparée au 2eme étage. Au 3 eme étage: deux chambres dont une avec mezzanine et salle de bain. Au ssol: accès au jardin et terrasse, atelier, cave à vin, cave et cave au charbon. Garage 1 voiture. PEB D. Info et visites Alessandro Meschi 0496 20 22 63', NULL, NULL, NULL),
(96, 255, 'eng', 'Commerce EU', 'Brussels EU - Commercial / office space in the heart of the European district of +/- 85m2 on two levels completely renovated. On the ground floor entrance with small kitchen and magnificent glass slab which gives a lot of light to the basement, shower room with WC, room at the back with storage room. In the basement, large room with separate WC, shower and laundry room. The property is in a recently renovated small building with very low charges. Info and visits Alessandro Meschi 0496202263', NULL, NULL, NULL),
(97, 255, 'fra', 'Commerce EU', 'Bruxelles EU -  Espace commercial/bureau au cœur du quartier Européen de +/- 85m2 sur deux niveau complètement rénové. Au RDC entrée avec petite cuisine et magnifique dalle en verre qui donne beaucoup de luminosité au ssol, salle de douche avec WC, pièce à l’arrière avec débarra. Au ssol, grande pièce avec WC séparé, douche et buanderie. Le bien se trouve dans une petite copropriété récemment rénovée avec des charges très faibles. Info et visites Alessandro Meschi 0496202263', NULL, NULL, NULL),
(98, 143, 'en', NULL, '1This superb 260m² duplex is on the 1st and 2nd floor of a wonderful \"maison de maitre\" in upper  Schaerbeek, near Wolumé. Large entrance hall, beautiful living room, dining room, study,  fireplace, modern fitted kitchen with breakfast area which opens onto a large terrace and private flower garden. Upstairs; 3 large bright bedrooms, 2 bathrooms and a dressing room. In the basement; 2 large cellars. Possible to sublet private parking for 120 € / month. Close to public transport, shops, restaurants, parks and the EU institutions. PEB is under way. Info/visits Sonja 0485271082', NULL, NULL, NULL),
